R["oh__@plain_sky"]="{['eu']={[40]={['N']='Topal Bay Island',['O']=19477,['D']='Sea Fangs Island\\nThe sea is calling you. Volcanoes, sea salt, sharp fangs and boarding in warm company, on the fastest vessel of the Topal Bay',['C']=1.015000,},[89]={['D']='Bone carver\\'s house\\r\\nHere, the honored master at the court has the opportunity to live a quiet life in unity with nature, to receive workpieces for his work from the castle pier. Sometimes personally go fishing to fresh air',['O']=19988,['N']='Blackwood Chapel',['C']=1.018000,},[54]={['N']='Wrothgar Ruins',['O']=19190,['D']='Fair of the Orcimer Hearth, held in one of the most picturesque and protected houses of Tamriel. There is real trade here. The best forge for those looking for hardened armour is taking the unusual orders. Warm conversations at the hearth, as well as fishing on the banks of high-mountain waterfalls, will help to pass your free time in a pleasant company.',['C']=1.016000,},[86]={['N']='Gold Coast Retreat',['O']=19724,['D']='Energy remnants are still exist in the Ayleid ruins. Veteran of Buoyant Armiger has found peace here among the Gold Coast, build stately chambers with loads of entertainment and even glamping for guests',['C']=1.017000,},[64]={['N']='Murkmire Pyramid',['O']=19238,['D']='An outpost of expeditions to impassable marshes on the northernmost edge of the lands of Murkmire. Life under the canopy of drunken forest, water magic, cartography, local secrets and customs, endemic vegetation and incredible panoramas of the province.',['C']=1.021000,},},['Key']='oh__@plain_sky',['TS']=1727023812,['Version']=1773,}"
