R["oh__@seecodenotgames"]="{['Version']=1773,['Key']='oh__@seecodenotgames',['TS']=1726695385,['eu']={[7]={['D']='Based on the lore book Picnic At Pelin (A Horror Story)',['C']=1.023000,['O']=19976,['N']='Picnic At Pelin',},[9]={['N']='Alinor Garden Party',['C']=1.021000,['O']=19955,['D']='The annual Alinor garden party has been relocated this year, due to ongoing turmoil on the island of Summerset, to the neighbouring island of Auridon. The Mathiisen country estate has opened its door to all men and mer. Dress code is formal.',},[11]={['N']='Who Lives in a Shoe',['C']=1.020000,['O']=19955,['D']='When the citizens of Stormhold found a daedric cult on the outskirts of their city, they found a reach witch and her adult children had died suddenly, possibly from poisoning. Now the new owner is a friendly witch who lives alone in this oversized shoe.',},[12]={['N']='DarkBrotherhood Home',['C']=1.023000,['O']=19965,['D']='A lost Dark Brotherhood Sanctuary found beneath an Argonian village.',},[13]={['N']='Crystal Gardens',['C']=1.031000,['O']=19955,['D']='Relax beneath the crystal trees of this enchanted garden.',},[15]={['N']='Treeship House',['C']=1.015000,['O']=19965,['D']='A Bosmer village awoke one morning to find an imperial ship in the treetops. So what did they do with it? They turned it into a new home. How did it get there? No one knows, but it does make an alternative treehouse.',},[20]={['O']=19965,['N']='Volkihar Courtyard',},[21]={['N']='Dark Elf Town House',['C']=1.021000,['O']=19955,['D']='A small and cosy town house on the edge of Mournhold.',},[23]={['N']='A Taste of Alinor',['C']=1.021000,['O']=19955,['D']='A small piece of Alinor situated beside a Rawl’kha creek.',},[25]={['D']='This mad scientist spends most of his days locked away in his workshop, trying to invent a means of traveling through time. So far his experiments suggest he on close to a breakthrough on his latest invention, the De-lore-ean.',['C']=1.027000,['O']=19976,['N']='Mad Scientists House',},[27]={['N']='ArenthianWaterTemple',['C']=1.037000,['O']=19955,['D']='This peaceful water temple is devoted to the eight divines. It is maintained by the dedicated caretaker who lives next door, on the grounds of an imperial landowner.',},[28]={['N']='Nord Lodge',['C']=1.051000,['O']=19966,['D']='A modest Nord lodge for a humble adventurer.',},[29]={['N']='Three Pillows War',['C']=1.022000,['O']=19955,['D']='Three friends are locked in their Windhelm retreat, but still want to have their camping trip, so they set up camp indoors. After a game of Monopoly: Tamriel edition results in the table being flipped, the three friends recreate the three banners war from the comfort of their pillow forts.',},[30]={['N']='Riften Meadery',['C']=1.024000,['O']=19967,['D']='Not to be outdone by the more famous Voljar’s Meadery, the Riften Meadery has often just outskirts of the Rift city.',},[32]={['D']='The undaunted have setup base in these Orcish looming towers on the outskirts of Mournoth. Inside there is a tavern for adventurers to relax after a long stint of dungeoneering and spelunking. There is also an iron forge on the roof top courtyard, where new weapons are crafted for the restless explorers.',['C']=1.017000,['O']=19984,['N']='Undaunted Fortress',},[33]={['N']='Almalexias Temple',['C']=1.026000,['O']=19955,['D']='A temple to Almalexia and the tribunal stands tall over a Dunmer town with followers coming from across Morrowind to learn about the divines.',},[36]={['N']='Hundings Beach House',['C']=1.018000,['O']=19955,['D']='This beach house has it\\'s own tower overlooking the sea. It even has its own hot tub.',},[38]={['N']='Vampire Academy',['C']=1.020000,['O']=19955,['D']='After being rebuilt for a third time, the Vampire Academy is having an open day for next year’s intake of students. Entry requirements are tight, and only a few students are selected each season. If you��������re not a vampire (yet), you can still join us for nibbles; you may even decide to stay (for eternity) in our grand castle just outside Daggerfall. Ignore the rumours of a secret lair beneath the city, all of our vampires are fully restrained and don’t practice any dark magic beneath your streets.',},[40]={['N']='Topal Fishing Resort',['C']=1.018000,['O']=19945,['D']='Rent your own private island and invite your friends over to this tropical paradise. Relax in the holiday village or spend your time fishing in one of our hidden lakes, all off the coast of the Topal Bay.',},[41]={['N']='Cave of BBQ N Ribs',['C']=1.024000,['O']=19945,['D']='A secret dome, built inside a dank and secluded cavern, hosts the best BBQ and ribs restaurant in Hammerfell. Just don’t steal my sweetrolls.',},[43]={['N']='Walled KitchenGarden',['C']=1.021000,['O']=19955,['D']='Our kitchen gardens are open to all visitors. Our produce is grown fresh by local farmers and available for purchase. You can taste our delicious cooked food in our family restaurant and bar. We also have a variety of fresh cut flowers for sale.',},[44]={['N']='Woodland Cottage',['C']=1.031000,['O']=19955,['D']='This gentle home is nestled inside an ancient wood. It is not a treehouse, but rather this Elven cottage fits snugly into a hollowed tree trunk and descends deep beneath the roots. It climbs up into the lofty branches and onto a private balcony, cut from the mighty trunk.',},[45]={['N']='Argonian Sea Town',['C']=1.018000,['O']=19955,['D']='A local Argonian port town has recently opened to trade and fishing on the coast of Inner Sea. There are a few local houses, a tavern, docks and a marketplace, and plenty of room for further expansion. An old shrine now serves as a lighthouse beacon.',},[46]={['N']='Imperial BridalSuite',['C']=1.021000,['O']=19955,['D']='Book your wedding at the most glamourous venue in the Gold Cost at this Imperial merchant’s manor just outside Kvatch. This Stately home has just undergone extensive renovations and redecorations throughout.',},[47]={['N']='Mushroom Manor',['C']=1.021000,['O']=19955,['D']='When an Hlaalu scholar was looking for seclusion to focus on his research, he didn’t anticipate his mushroom manor being pulled into the Daedric realm of Coldharbour. His retreat was built from the canopies of seven giant Vvardenfell mushrooms, with enough space inside for an extensive library, dining hall, two bedrooms and an open living room, as well as room for outdoor dining.',},[49]={['N']='The Secret Tower',['C']=1.020000,['O']=19955,['D']='The Witch Tower Inn just wasn�������t creating enough business in the middle of a swamp, so the owner sold it to a Breton Wizard. He then transformed it into a studious mage tower, where he practices arcane rituals away from watching eyes.',},[54]={['N']='Mountainside Retreat',['C']=1.024000,['O']=19955,['D']='Relax with mug of ale and a spectacular view of the sunny vales of Wrothgar from this Orcish hall, carved into the side of a mountain.',},[55]={['N']='City on the Moon',['C']=1.032000,['O']=19955,['D']='This Moonbase is more than just an excellent research space, it is also the gateway to a lunar city. Permanent dwellings house the city’s residents and it even has an inn under the stars.',},[56]={['N']='Dwemer Cave City',['C']=1.020000,['O']=19955,['D']='Found deep within an extensive cave network, beneath the city of Kvatch, is a long lost city of the deep folk. No one knows how long they’ve been gone, but they must have left in a hurry, as their lights are still shining brightly.',},[57]={['N']='Dawnlight Health Spa',['C']=1.014000,['O']=19955,['D']='Need a break from adventuring and fighting? Our spa waters are revitalising and ready to heal your aching body.',},[58]={['N']='Helenes Writing Room',['C']=1.025000,['O']=19773,['D']='A small private room where Helene can get some quiet time to finish her novels.',},[59]={['N']='Castleton Manor',['C']=1.026000,['O']=19955,['D']='Sonja is due to be married to the eldest son of a rival noble house. Her father Lord Castleton has commissioned the famous dress maker Helene Dassovia to create a wedding dress for the big day, but Sonja is more interested in the judicial duel in the manor courtyard.',},[60]={['N']='Alinor Gryphon Aerie',['C']=1.020000,['O']=19955,['D']='The Gryphon Knights didn\\'t always ride from the mountain tops of Cloudrest. This lesser known Gryphon Aerie is accessible only via a partially collapsed cave system or by boat.',},[61]={['N']='Hircine\\'s Hunt Club',['C']=1.043000,['O']=19944,['D']='Come join our exclusive club in the hunting grounds. To find us us you must first prove yourself worthy in Hircine��s eyes, and gain the hunt master������������������s gift. We have game and mead for all our brothers and sisters to savour the endless feast. Just don’t be screamish if the meat comes raw and bloody.',},[62]={['N']='Artaeum Theatre',['C']=1.040000,['O']=19294,['D']='Disconnected from Tamriel and the rest of society, you’d think that this opera house on a hidden island wouldn���t get many visitors, yet they’re sold-out every weekend. Includes its own divine chapel by the mysterious Artaeum waters for those who would rather relax with a book.',},[63]={['N']='Winter Snow Meadhall',['C']=1.013000,['O']=19955,['D']='Looking for a place to get out of the cold snow and a hot meal with a flagon of your favourite mead or ale? This mead hall has opened for the season and will stay until the final frost thaws in the coming spring. If you need a place to sleep there are also beds and baths available in the lighthouse.',},[64]={['N']='LakemireWaterGardens',['C']=1.021000,['O']=19944,['D']='Relax in our tranquil water gardens or explore the hanging gardens of Lakemire. Once you have worked up an appetite, you can visit our seafood restaurant beneath the Xanmeer, where you can eat the catch of the day, while watching the fishes swim behind the magical picture windows.',},[96]={['N']='Pirate New Life 4 Me',['C']=1.015000,['O']=19955,['D']='When the year is coming to an end, the pirates of the Abecean like to gather in their favourite tavern, The Drunken Sailor, and share their ill-gotten loot and bounty with the local children. (If anyone asks, these are the gifts of honest work). It\\'s also a way of clearing out unsellable loot and avoids the gaze of the cargo inspectors.\\nGardens will be opened soon.',},[65]={['N']='Knight Club',['C']=1.050000,['O']=19955,['D']='Welcome to the most exclusive club in Tamriel. We have a DJ, bar, relaxing lounge and of course our glass dance floor. There is also an event room at the back for those with guests to entertain.',},[66]={['N']='Fire And Ice Hotel',['C']=1.024000,['O']=19955,['D']='Our hotel caters to those seeking an adventure. Will it be the frigid chills of the ice sculpture room? Or the fiery pits of our deadlands-themed suite? Our hotel has an ever frozen ice bar, magically frozen so the ice never melts, and a BBQ grill house for those with a taste for flaming steaks.\\r\\n\\r\\nOur hotel is the perfect venue for a wedding or a special event, overlooking an erupting volcano. There is also a Breton cottage with traditional furnishings, for those who are afraid of a challenge.',},[99]={['N']='Wedding At Sea',['C']=1.015000,['O']=19958,['D']='Sail the high seas in luxury, with all the guests you need, to celebrate your special day in style. This floating wedding venue is equipped with an altar, above and below deck dance floors, private bridal suite in the captain’s quarters and enough room for up to thirty two guests*. Don’t delay, as bookings have a six month wait.\\n* Limited to 24 actual players',},[69]={['N']='DragonguardClubHouse',['C']=1.021000,['O']=19944,['D']='After extensive renovations, the Dragonguard Penthouse has reopened to its members. Now fitted with a top floor gym, members of the reformed ancient order can keep healthy and relax while they are taking a break from slaying the dragons destroying Elsweyr. Hidden inside the walls of Jode’s Embrace, across three additional spacious floors, the Dragonguard Penthouse is open to members and visitors.',},[70]={['N']='Dwemer Party Tower',['C']=1.027000,['O']=19955,['D']='This Dwemer Tower is actually an ancient flying machine, which can fly anywhere in Tamriel, but expect a long slow journey; more time to enjoy the amazing views and relax with friends. Food and drink will be served throughout. Currently it is docked above the forests of Southern Elsweyr, near a place known locally as Lion’s Cradle.',},[71]={['N']='Treefern House',['C']=1.021000,['O']=19955,['D']='When a giant treefern was discovered growing in Tenmar Forest, a wealthy Khajiiti merchant from Rimmen decided it was the perfect place to build a treehouse to relax when not peddling his wares.',},[72]={['N']='Spirit-Tree Library',['C']=1.025000,['O']=19955,['D']='A band of five scholars and explorers discovered an ancient forest, buried deep inside an even older Daedric cultist���s lair. After many years of hard work, they have finished their new library, built around the spirit tree at the centre of the dark wood.',},[73]={['N']='Luckycat Summerhouse',['C']=1.021000,['O']=19945,['D']='Cool off from the hot Elsweyr sun at our Senchal Luckycat�����s Summerhouse. This villa has a large reception room, kitchen, bathroom and sheltered patio. Upstairs there is a quiet meeting room and large bedroom overlooking the sea.',},[74]={['N']='Radas Summer Getaway',['C']=1.017000,['O']=19941,['D']='Even a vampire lord as ancient as Rada al-Saran occasionally needs a break from his evil plans and alchemical research. This domed palatial mansion was his secret getaway, although the new owners are questioning what to do with the vampire lair in the basement of their new home.',},[75]={['N']='Icy Falls Inn',['C']=1.022000,['O']=19876,['D']='Come in from the cold and warm your belly with hot food and fine mead. Our hearth is warm, and our guest rooms are ready to welcome the weary adventurer. We have plenty of fare to get you into the festive spirit. The two inn rooms sit over a freshwater lake fed by frigid icy falls. Any fish you catch will be cooked for you over an open fire.',},[76]={['N']='Golden Beach Palace',['C']=1.035000,['O']=19945,['D']='Relax by the pool in this Redguard beach resort, inspired by Dwarven architecture. Includes two bedrooms, an open kitchen diner and a large sun terrace on the roof.',},[79]={['N']='Lava Submarine Base',['C']=1.023000,['O']=19955,['D']='After moving into an abandoned castle, deep into Blackreach, a member of house Ravenwatch discovers the secrets of this forgotten abode go even deeper. Beneath the ancient stone structure is a hidden laboratory, accessible only via an underground lava tunnel. The previous owners were in such a hurry to evacuate that they left their prized lava submarine in the docks beneath the keep, and a lab full of alchemical experiments and reagents.',},[80]={['N']='Blue-ice Palace',['C']=1.017000,['O']=19955,['D']='After being banned from Solitude, an exiled Nord noble set about recreating the Blue Palace on a permanently frozen lake east of Morthal for his large family.',},[81]={['N']='Big Toy House',['C']=1.022000,['O']=19955,['D']='The eccentric owner of this Hjaalmarch homestead has decided to build not one, but two, life-sized doll���s houses to celebrates his daughter����s marriage. Afterwards they can celebrate in the inn beneath the stairs.',},[82]={['N']='Lost Dwarven Kingdom',['C']=1.020000,['O']=19955,['D']='Centuries ago, this vast palace housed the remnants of the last Dwemer Kingdom. Now this building has been found floating in a mage���s pocket realm, preserved for all eternity. New owners have converted this once regal palace into a place of study, in the vast emptiness of this solitary realm.',},[83]={['N']='Markarth Bath House',['C']=1.014000,['O']=19955,['D']='After a long day of adventuring, come visit our newly opened hot spring baths and cleanse your weary body. Located in a Dwarven mansion, we have a warm relaxing spa, high pressure shower and space to eat and dine. We also allow our guests to stay the night. There is also an arts and craft centre for those who want to relax the mind, as well as the body. We have just extended the manor and built a brand new VIP bath house adjacent to the main building, equipped with facilities for your every need',},[104]={['N']='Azandars Tea House',['C']=1.024000,['O']=19925,['D']='Azandar will always take a detour if the rewards comes in the form of tea. Now he has enough to open his own tea house.',},[85]={['N']='Volcanic Vile Villa',['C']=1.020000,['O']=19955,['D']='Who wouldn’t want their own secret lair in a private volcano?',},[86]={['N']='Varlaisvea College',['C']=1.020000,['O']=19955,['D']='Found deep in an Ayleid well, Varlaisvea College has reopened to a new generation of students. This academic centre is equipped with a massive library, dining areas, and a brand new study hall and swimming pool.',},[103]={['N']='Alikr Oasis Paradise',['C']=1.021000,['O']=19955,['D']='A deep underground well keeps this small patch of desert on the border of the Alik’r fertile. A perfect location to build a grand home to commemorate their sword-singer ancestors.',},[88]={['N']='Helene\\'s Boutique',['C']=1.026000,['O']=19955,['D']='The world-renowned dress maker Helene Dassovia has just opened a new boutique in town. Whether it be an evening gown for a garden party, a beautiful wedding dress, or just a frock to impress your friends, Helene��s Boutique has a dress for every occasion. Just don’t expect much change if you buy one of her famous garments.',},[89]={['N']='City of Princes',['C']=1.017000,['O']=19955,['D']='Prince Tarvia has just helped evacuate his friends from Citadese, the city of princes, to escape the looming dragon invasion. After trekking through damp sewers, he must return to the college library to retrieve a special book that may help solve the mystery the mirror portals hidden beneath the city.',},[90]={['N']='The Charred Towers',['C']=1.017000,['O']=19679,['D']='Welcome to our fortress in the Deadlands. There\\'s a dining hall with open plan kitchen and living space, a library, a forge and a covered balcony with a great view of the lava fields. Just don\\'t get runover by the Deadlands Demolisher.',},[91]={['N']='Cascadia Wine N Dine',['C']=1.021000,['O']=19955,['D']='You are invited to our winery, where you can drink and dine with style. Our halls are laden with fresh prepared food and our pantries are always well stocked. Our grapes are harvested on site, and stored in our extensive wine and beer cellars beneath the manor. If you have a large party, you may prefer the privacy of the moated guest house and divine chapel across the courtyard.',},[92]={['N']='Fargrave Observatory',['C']=1.032000,['O']=19955,['D']='A group of mages have setup a observatory in the portal realm of Fargrave. They have setup their telescopes and instruments in an attempt to measure the cosmos. There is also a museum and art gallery in the main building.',},[93]={['N']='Woodvine Cathedral',['C']=1.020000,['O']=19950,['D']='Stuck out in the deadlands, this living cathedral regenerates itself against the backdrop of a barren dead landscape. Wood Elves, Druids and everyone with a connection to the Green travel from Tamriel to see the sacred living temple for themselves.',},[94]={['N']='DaedricPrincessTower',['C']=1.020000,['O']=19955,['D']='The Psijic order were exploring a way to build a new underwater research centre, when they accidentally opened a rift to Meridia\\'s Colored Rooms and pulled a piece of the Daedric prince\\'s realm into an underwater cave system.\\nWell, now you have the opportunity to live like a princess in your very own tower beneath the sea, just don\\'t expect to be rescued by the charming Darien.',},[98]={['N']='Sand Castles',['C']=1.018000,['O']=19955,['D']='This literal sand castle was built as a luxurious vacation home off the coat of Vastyr, for the richest Bretons of Highrock to relax during the summer months. Unfortunately the awakening of the Mount Firesong has caused part of the outer walls to collapse into the sea. Now only one of the four turrets and the inner keep are open to visitors due to the risk of further collapse.',},},}"
