R["oh__@elvenheart"]="{['Key']='oh__@elvenheart',['na']={[49]={['N']='Witches Hut',['D']='Come little children\\r, I\\'ll take thee away\\r into a land of enchantment\\r\\nCome little children\\r, the time\\'s come to play, here in my garden of shadows.',['C']=1.002000,['O']=19294,},[90]={['N']='Deadlands Plot',['D']='Hello everyone, and welcome to my first castle! When I was looking for inspiration on how to use Doomchar Plateau, I looked in the Housing forum and watched YouTube videos and discovered so many wonderful houses this way, got more into housing than ever before, and started using EHT. One of the videos I found was a castle built by an Xbox player named My Protolog1st, and I was blown away by what I saw! So I have to give him credit by saying my castle was HEAVILY inspired by his. Enjoy!',['C']=1.017000,['O']=19028,},[86]={['N']='Circle Expedition',['O']=19969,['C']=1.018000,['D']='Thanks to a generous donation from Imperial and Breton backers, the Antiquarian Circle have been able to set up a camp from which to investigate the recently discovered Varlaisvea Ayleid Ruins. Who knows what exciting discoveries await Historian Phedre and her team!',},[38]={['N']='Valtieri Manor',['D']='Welcome to my Daggerfall house! Come freely, go safely, and leave something of the happiness you bring!  ^v^',['C']=1.051000,['O']=19978,},[63]={['N']='New Life Snow Globe',['D']='Hello again! If you have time, I\\'d love for you to stop by my Snow Globe. Burn a candle at the Old Life shrine and check out my festive New Life hearth (but be careful around the fireplace - a strange blue vine has started growing around the monster trophy hanging there and it doesn\\'t look safe). And a Dwemer oven painstakingly reconstructed into its former glory sits in the kitchen, cooking food for the upcoming feast. And finally, the bedroom is all ready for a nice quiet romantic getaway!',['C']=1.022000,['O']=19352,},},['Version']=1773,['TS']=1726162024,}"
