R["oh__@lotlurien"]="{['TS']=1726068862,['Key']='oh__@lotlurien',['Version']=1773,['eu']={[1]={['N']='Nameless Hero',['O']=18749,['C']=1.029000,},[2]={['N']='Cassanova rest place',['O']=18749,['C']=1.007000,},[3]={['N']='Dunmer Inn Room',['O']=18749,['C']=1.007000,},[4]={['D']='I am the guardian of the unseen, and knower of the unknown. I have been watching you, mortal.',['N']='Forbidden Knowledge',['O']=18864,['C']=1.026000,},[5]={['D']='The apartment of the skilled hunter and his job deals. Mostly hired by mages guild not for hunting and killing but for tracking and catching daedra alive and this accommodation is directly adapted to it- cages, books about daedra and the comfy spot where deals are made.',['N']='Hunter business spot',['O']=18897,['C']=1.007000,},[7]={['D']='The strange home of I S\\'hee The\\'thees and his friend Lyranth. Both of them have neverending curiosity for mortals and mortality itself. And they will do anything to fill their hunger for knowledge and secrets of Nirn and this little house has every tool for it.',['N']='Kyn\\'s Home',['O']=18918,['C']=1.023000,},[8]={['N']='The Humble Library',['O']=18749,['C']=1.025000,},[10]={['D']='Draws-With-Blood is skilled with alchemy and poisons, necromancy, and his hobby is of course drawing. He was born with the blessing of the Sithis so his path led him into the ranks of assassins. He is using his talents for various tasks that are sealed under the secret of the black sacrament. All he can reveal is that currently, he works as a diplomat between branches of assassins guilds across the Tamtiel: the Dark Brotherhood, Shadowscales, and Morag Tong.',['N']='The Spooky Sanctuary',['O']=18951,['C']=1.038000,},[11]={['D']='House of former slave Scuttles-This-Way. She discovered these ayleid ruins taken on her business trip as a mercenary in Shadowfen. It is true that she does not revere the Hist (she was kidnaped from Murkmire as an egg) but she still feels that deep bond with it and with other Argonians. So she decided to know more about her lost culture from the beginning and this place was ideal to study the connection between Ayleid people and the disappearance of Xammers from Tamriel in Merethic Era.',['N']='Saxhleel Roots',['O']=18882,['C']=1.025000,},[12]={['D']='In Shadowfen, where swamp sleeps,\\r\\nAn Argonian village, calm and deep.\\r\\nAround the Hist, they build their homes,\\r\\nIn harmony where nature roams.\\r\\nThe ancient tree, with whispers old,\\r\\nSpeaks of secrets never told.\\r\\nRoots entwined in sacred ground,\\r\\nA bond of life, profound, unbound.\\nEggs that shimmer in the night,\\r\\nAwait the dawn\\'s first gentle light.\\r\\nThe Hist tree speaks in silent song,\\r\\nGuiding them where they belong. \\r',['C']=1.026000,['O']=19966,['N']='Xil\\'kura Taakal',},[13]={['N']='Shrine Of Flowers',['O']=18749,['C']=1.037000,},[14]={['D']='House of WW bosmer Otráven������ Karamelka (Poisoned Toffee). When she was a pup, she stole part of the mysterious magic stone and this is why there are magical flying stones, trees, glowing crystals, and flowers. And this is why she can relax here so much with all of her pack family under the blessing of the lord Hircine himself.',['N']='Magic gone wild',['O']=18864,['C']=1.031000,},[15]={['D']='In the heart of Grahtwood, nestled among the towering graht-oaks and dense jungle, lies the secluded Altmer settlement of Innedell. Founded during the mid-First Era by a group of Altmer mages and scholars led by Vaelion Innedell, Innedell was established as a refuge and center of learning for those seeking to explore the ancient mysteries of Valenwood while remaining connected to their Aldmeri heritage. As the centuries passed, Innedell remained a small but vibrant community.',['C']=1.041000,['O']=19966,['N']='Innedell',},[16]={['D']='The owner of this humble house had big plans to establish knick-knacks for the needs of every adventurer, scholar, or even an art collector. And of course, to made trades even more convenient, the bank was on reach, right above on the first floor. But the owner forgot that this city already having a bank and merchant conveniently placed few houses away. So now he is trying his best to win new customers and keep his regulars to somehow make a decent living for himself and his two loyal employees.',['N']='Knick Knacks',['O']=18948,['C']=1.030000,},[17]={['D']='The current owner has a good reputation among residents as a merchant, traveler, alchemist and a bit of a weirdo. He stays in seclusion and when he occasionally visits the local inn, it happens that he shares interesting and mysterious stories from his own, as he calls them \"business trips\". Many people think that most of them are made up, but only a handful of his friends, who often come to him for longer visits and some accompany him on his travels, know where the truth is.',['N']='Fell\\'s Run House',['O']=18888,['C']=1.051000,},[19]={['N']='Enchanter Emporium',['O']=18749,['C']=1.020000,},[20]={['D']='When the previous owner - dunmer magus moved out, he left here his entire collection of magical artifacts, including magical mushrooms and magma stones. After centuries, this place was discovered by Mirri on her travels and decided to make here her safe place - a temporary camp in the back cave. Luckily, she does not mind a little bit of lava.',['N']='Mushrooms and fire',['O']=19435,['C']=1.021000,},[21]={['D']='House of Nénar Kal, house of Indoril. She is a huge fan of Sotha Sil and his creations and hopes, that her hard work and research will open the way into Clockwork city. So her home is not for resting and chilling but for research and science to uncover the mysteries of Tamriel. Few may think that is too dangerous, they say she is playing God. But she has a clear mind and is focused on her target: the magical fusion of life energy and mechanics. ',['N']='Pundit sanctuary',['O']=18864,['C']=1.027000,},[22]={['D']='House of maormer/altmer ship captain Az��riah Ancalima and who is looking for her lost brother after the death of their mother. She and her crew temporarily took shelter on land, in this cozy house to investigate the leads and make preparations to continue the search.',['N']='Maormer Hiding spot',['O']=19312,['C']=1.026000,},[23]={['D']='Are your paws tired and belly empty? Come chill and fill your stomach here, in the cozy atmosphere of this one small restaurant, yes? And if you are a fan of tea houses, this one has a dedicated area for you too. Please, welcome and enjoy the comfort of Purrs&Chill, tea&grill restaurant.\\r\\nMay your road lead you to warm sands.',['N']='Purr&Chill',['O']=18916,['C']=1.024000,},[25]={['D']='What house of alchemist needs? Lots of ingredients, of course, fresh ones are preferred. And you find that here. The owner is a famous imperial alchemist and his collection of plants and mushrooms is known worldwide. If you need to get a rare potion or if you need to experiment on your own feel free to visit, but please, do not break something and keep the lab clean.',['N']='Alchemist Emporium',['O']=18951,['C']=1.021000,},[26]={['D']='Take a journey back to the beginning of modern humanity, into the home of the caveman, when the \"spirits\" of the hunt were present, and when the first people tried to create a safe place to survive and ensure the survival of the entire clan.',['N']='Late Stone Age',['O']=19966,['C']=1.030000,},[28]={['D']='When dragons awoke in the Elsweyr, members of the Dragonguards had to act quickly. They know that dragons will not stay only in elsweyr and to be able to fight them they need to train new members in every corner of Tamriel. And thus, the Riften Dragonguard hall was established with legendary dragon hunter Chirsari-daro as the head commander.',['N']='Dragons Hunters Den',['O']=18948,['C']=1.026000,},[29]={['D']='A Hot Dumplings Inn welcomes you with good food, tasty mead, a warm beds and moderate prices. Inn owner, Nori Dumpling will ensure that you would want to come back. Her smile and dumplings are legendary in Windhelm after all. What else do you need in the harsh nord winter?',['N']='Hot Dumpling Inn',['O']=18881,['C']=1.024000,},[31]={['N']='Mighty Cat Pub',['O']=18749,['C']=1.013000,},[32]={['D']='The house of Gonna Gra-Shemall (gonna crash them all), the orc retired warrior. When she was active she traveled through Tamriel as a mercenary. She has experienced many adventures on her journeys and so she collected many trophies that you can see all over the house. Now she is enjoying her hobbies as growing veggies and caring for the pets. In addition to housework, she still keeps in the shape by helping folks in need or just simply throw knives in the kitchen.',['N']='Bhazzul House',['O']=18864,['C']=1.026000,},[34]={['D']='Calesannah de Odor Morda lost her only family - her trusted senche due to the sickness. She was so sad about her death that when she heard that there is a possibility to bring her back, she does not hesitates. She succeeded and this love and broke heart carved her path into the art necromancy. Due to this, she soon was outcasted from the redguard village she lived and ended up here, where she lives in peace and disturb no one.',['N']='de Odor Morda',['O']=18881,['C']=1.026000,},[35]={['D']='You surely know the legendary treasure hunter Falion L\\'eki. No? Really? Anyway, welcome to his little inn. He establish it after he gathered enough gold from his adventures and now he is using it as his base for trading and of course to moisture dry throats of his regular customers. For those who need it, there are even free beds for the night\\'s peaceful sleep before venturing into the Alik\\'r Desert.',['N']='Sentinel House',['O']=18951,['C']=1.011000,},[36]={['D']='Little port village for seekers of knowledge and travelers across the mundus and other realms. They can rest, share stories, seek new information, and trade items collected into the mundus and other planes. This place is under the protection of Azandar, an arcanist who is chasing fate itself.',['C']=1.041000,['O']=19977,['N']='Arcanport',},[37]={['D']='After a long time of searching and digging, the secret Magic Market, in the bowels of the magical cave, was finally discovered and visited.\\nHere you will find merchants offering everything related to occult practices, fortune telling, crystal divination, astronomy, and more. At the same time, the Magic Market pub is also close at hand, where there is a place to conclude various agreements, exchange magical artifacts or relax in the magical atmosphere of the Endless Waterfall.',['N']='The Magic Market',['O']=19525,['C']=1.041000,},[38]={['D']='Speculation whispers on the breeze,\\r\\nAbout the secret to this vineyard harvest\\'s ease.\\r\\nEven Mr. Thunderboots, with a curious gleam,\\r\\nCame to investigate the rumor\\'s dream.\\r\\nWill you join him in unraveling the tale,\\r\\nOf this vineyard\\'s secrets, beyond the veil?\\r\\nOr would you rather unwind, with wine in hand,\\r\\nIn delightful conversation, where dreams expand?\\r',['N']='Daenia Dolmen Manor',['O']=19899,['C']=1.024000,},[39]={['D']='Don\\'t judge a book by its cover, but don\\'t be afraid if you have an honest heart. House of Lilabati the Disobedient, necro vamp healer - that creepy monster that will not hesitate to take over any evil creature and then become her play puppy. He sometimes helps desperate people and is not afraid to punish by death those who hurt them. But on the other hand, it can also heal. Despite this, most people are afraid of her, although she only hurts those who deserve it.',['N']='Sweet Webs',['O']=19415,['C']=1.023000,},[42]={['D']='A quiet place for dedicated dumner.',['N']='Vivec nearby',['O']=18916,['C']=1.051000,},[44]={['D']='HO HO HO welcome and enjoy the Christmas festival with all the games, shops, warm food, and good drinks! ',['N']='Winter Market',['O']=18984,['C']=1.016000,},[47]={['D']='When Molag Bal invaded Tamriel, on the land warriors defeated his anchors. But on the see he accidentally summoned a few of his anchors right into the Eltheric ocean and pull a big piece of it into his realm. This place was discovered by Nénar Kal and scholars from mages university. They managed to establish a magic barrier and created an underwater promenade. So take a deep breath and you can explore hidden treasures. For fearless, there is an opportunity to explore the deepest parts of it.',['N']='Under the Sea',['O']=18864,['C']=1.012000,},[49]={['D']='Locals tend to avoid the ruin of the old Motchad chapel, saying that weird energy is gathered there and in the night even the ominous aura is glowing from there. They noticed, that an odd hermit calling herself Guardian of the Green started to live there. She does not seem evil but everyone feels that she is best to keep her as an ally. Rumors say that she can bend the old, raw magic for the good deeds but for the bad deeds either. What is truth and what is just a myth of scared townfolks?',['N']='Old Motchad Chapel',['O']=19021,['C']=1.038000,},[58]={['D']='First \"Flat\" of Sir Meowximus Purrime. After he was kicked out by his parents to finally make living on his own, this was his first place to live, a small, cozy room, whit every property that he was able to put here.. And a little comfort in the form of a private bath (Sir Meowximus has altmer quirk after all).',['N']='Snob Room',['O']=18864,['C']=1.049000,},[59]={['D']='House of Sir Meowximus Purrime. He was adopted as a stray kitten by altmer pair. And when they found out that he is not a cat but khajiit, they decided to adopt him and raise him...as a proper altmer. He created here his own kingdom for comfortable living in the altmer town. In the backyard, he let live his kin-friend Lotlurien-daro, a legendary adventurer, under the promise that she will learn him how to become legendary as well. But for now, just enjoy this comfort for a while, right?',['N']='Hidden Cat Retreat',['O']=19415,['C']=1.051000,},[62]={['D']=' In the shade of Psijic University a little town of Mawa can offer many thing for every promising students of magic what they might need. Residents are quiet and friendly so come to visit. Everyone is welcome:\\r\\nAnd if you are wondering: Am I capable to become a student of the Psijic University?, the entrance exam is simple for those who are gifted: just try to pass through the magic barrier. If you do, you can enter the restricted area of the University itself and fulfill your potential.',['N']='Mawa University Town',['O']=18881,['C']=1.041000,},[81]={['D']='\\rWelcome to the Sorber Horker hero! \\r\\nNeed a shelter? We have free rooms!\\r Is your stomach hungry and mouth dry? We have everything to please your tastes!\\r Homemade mead and fresh ingredient for the cooking and comfortable rooms make our inn the perfect spot to stop before and after every adventure! \\rEvery adventurer is welcomed! Nori Dumpling, the inn owner\\r\\nP.S: Behave yourself, no fights or destroying property! Otherwise our guard will give you quick lesson how to swim in the lake!',['N']='Sober Horker',['O']=18864,['C']=1.051000,},[82]={['D']='',['N']='The Never-There',['O']=18864,['C']=1.044000,},[68]={['D']='Current shelter of the legendary khajiit, hero, adventurer, seeker of secrets, and tongue of truths. Or not? Well, that depends who you will ask.',['N']='Oasis',['O']=18889,['C']=1.026000,},[70]={['D']='House of the pirate captain Raevina Melle Manantem and her crew. She is an imperial deserter who ran away from the Three Banners\\' War after her parents were killed. She is blessed by the \"call of dragon blood\" and this gift resonates strongly as dragons reappeared in Elsweyr. Her interest in dragons made her stays longer on the land so she and her crew managed to create a shelter for every person in need to stretch his legs, relax and make some golds hidden from the eyesight of the government.',['N']='Azra\\'ri: Pirate Town',['O']=19281,['C']=1.041000,},[71]={['D']='This one is recommending visit this shrine, especially if you seeking inner peace and wealth. And maybe not just that the spiritual one, sneaky khajiit knows what he talks about. Just go there and have your soul and eyes open and gods will give you a sign.',['N']='A humble temple',['O']=18948,['C']=1.041000,},[104]={['D']='Pathways lit by softest glow,\\r Ethereal light in gentle flow.\\r Pools reflecting canopy’s green,\\r Rippling with magical scenes.\\r Within this haven, pure and grand,\\r A magician’s touch guides the land.\\r Spells are woven, potions brewed,\\r Arcane secrets softly viewed.\\r \\rA sanctuary, wild and free,\\r Where nature meets with sorcery.\\r In this grove, where wonders lie,\\rMagic whispers, and spirits fly.',['N']='Twinkling Sanctuary',['O']=19966,['C']=1.020000,},[90]={['D']='Don\\'t miss the second floor behind the entrance portal! Welcome to the home of Dar\\'mrissi, a curious and eccentric Khajiit daedrologist. Dar\\'mrissi\\'s fascination with Daedric lore led her down a path few would dare to tread. Her passion for studying the realms of Oblivion and the enigmatic Daedric Princes grew so intense that she began to blur the lines between researcher and resident of these dark domains.',['N']='Deadlands Place',['O']=19966,['C']=1.023000,},[87]={['D']='The gates of oblivion are waiting in most unexpected places.',['N']='Into the Oblivion',['O']=18833,['C']=1.026000,},[77]={['N']='Solitude Inn',['O']=18749,['C']=1.007000,},[78]={['D']='Here lives the warrior of Thane of Solitude, Gundyr Wonter-foot, head of the Winter-foot clan. As a proud Nord, he displays his adventures, his trophies, and his faith in his house. And as a true Nord, he has always food and mead at the ready for him and his friends. If you are up for an adventure, you can join his party and discuss the plan for the next venture by the round table upstairs and prepare some armor, weapons, or potions for the upcoming quest.',['N']='Thane Warrior',['O']=19415,['C']=1.051000,},[95]={['D']='',['N']='Artisan Studio',['O']=19318,['C']=1.030000,},},}"
