']=19955,['C']=1.017000,},[19]={['D']='One room housing build. Archéological site/Interdimensional portal',['N']='Oblivion portal',['O']=19955,['C']=1.020000,},[15]={['D']='Come and feed yourself to the great Serpent.\\n(Not a finished work, but I am a little bit tired by this build. Careful for those who are scared by snakes!)',['N']='Snake temple',['O']=19955,['C']=1.031000,},},}"
