R["oh__@lady_rosabella"]="{['Version']=1773,['TS']=1725321103,['na']={[80]={['D']='Along the frozen coast of Western Skyrim, hidden from others and only accessible through a secret Dwarven passage way, you will find a quaint little cozy cabin. The cabin serves as a retreat for Rosabella and Xalvador when they feel the need to get away from it all and connect with nature. Endless nights are spent relaxing in the hot-springs-fed pool, warming themselves by the firepit, or just relaxing together in the warmth of the cabin. ',['O']=19718,['N']='Snowy Pines',['C']=1.036000,},[74]={['D']='Looking for adventure, Ember travels to the Khajiit homeland, Elsweyr. While exploring the region, she realizes that there was lots of gold & treasure ripe for the taking. Unable to fight the urge, Ember returns to her old \\'Street Kid\\' thieving ways. Now, with more riches than she could ever dream, she finds herself the pefect location in Southern Elsweyr to build her dream home, largly constructed with golden accents made from melting down some of her stolen treasures, Ember is living the dream',['O']=19618,['N']='Ember\\'s Dream Home',['C']=1.050000,},[98]={['D']='After helping eliminate the threat of the Ascendant Order\\'s plot to disrupt the peace summit, Akeso\\' decides to lay down her weapons for good & retire. Guided by the warm glow of Systres Lighthouse, she sails her tiny fishing vessel along the shoreline of the island until she comes across a small cove protected on three sides with large boulders. Satisfied that this beautiful cove would offer a safe retreat from the outside world while also providing relaxing tranquility for the rest of her life',['O']=19552,['N']='Achmelvich Cove ',['C']=1.018000,},[91]={['D']='Mt. Rose Vineyard, a hidden treasure in the mountains between Blackwood & Northern Elsweyr. There you will find rows of grape laden vines alongside a tranquil pond. Lounge by the waters edge & enjoy a glass of Tamriel\\'s best wine. Join Biro-Dar at the press & stomping tub. Remove your shoes & socks, roll up your pants, to do some barefoot grape stomping. Make your way into the cellar for wine tasting. Try our specialty wines paired with cheese & breads made by neighboring artisans. Enjoy!',['O']=19512,['N']='Mt. Rose Vineyard',['C']=1.021000,},},['Key']='oh__@lady_rosabella',}"
R["oh__@klaushaus89"]="{['Key']='oh__@klaushaus89',['na']={[105]={['N']='Druidic Grove',['O']=19737,['D']='Scenic Garden',['C']=1.021000,},[107]={['N']='Crafter\\'s Haven',['O']=19954,['D']='A chill little area to craft in the cave. A fisherman\\'s hideaway and much more! Come visit, relax, craft, all mundus stones here as well as a couple target dummies! Make yourself at home!',['C']=1.010000,},[100]={['N']='Necrom Inn',['O']=19806,['D']='Zone out in this psychadelic room and just chill.',['C']=1.500000,},[13]={['N']='Elden Root House',['O']=19806,['D']='Crafting nook. A little crafting nook to get away from it all and focus on your tasks.',['C']=1.009000,},[94]={['O']=19968,['N']='The Tavern',},[60]={['N']='High End Dining',['O']=19954,['D']='Take the path off the bow (starboard side) of the ship to the beach. Take the next path and journey up the spiral staircase. There you will find an upscale restaurant overlooking the sea. Enjoy your meal!',['C']=1.018000,},},['TS']=1725293471,['Version']=1773,}"
