R["oh__@raenesviel"]="{['TS']=1719533978,['Key']='oh__@raenesviel',['na']={[36]={['D']='Once secret moorage for Maomer pirates and a slave auction, Satak Mitana has been claimed by the wretched, the poor and even the faithless.  It clings to the shores of southwestern Alik\\'r, protected by its remoteness and inhospitable clime.  Nevertheless, it is a black market bazaar for the illicit and the strange as well as a lawless hideaway.',['N']='Satak Mitana',['C']=1.007000,['O']=19797,},[107]={['D']='Between Skingrad and Arenthia there are a few roads that traders and caravans might take through the West Weald and over the Strid.  The highland path had always been the more dangerous.  That is until a strange Bosmer opened the High Road Tavern, catering to idle adventurers.  It\\'s said they make the time for the poor, and the wretched.  Who knows?  At least the road is safer.\\r\\nWeekly open RP tavern night Wednesdays 9pm - Midnight EST.\\r\\nAll Are Welcome.',['N']='The High Road Tavern',['C']=1.007000,['O']=19902,},},['Version']=1773,}"
