R["oh__@symphanizer"]="{['Version']=1773,['Key']='oh__@symphanizer',['TS']=1719019732,['na']={[98]={['O']=19629,['C']=1.041000,['D']='A small quiet town along the Strid River were refugees of the Banner war can come and gather while still being in their homeland - Cyrodiil.',['N']='Firelight Hamlet',},[94]={['O']=19609,['C']=1.015000,['D']='The Ship known as the Hopeful is a Imperial Caravel traveling the Sea from the Abecean to Topal Bay. Can be used for RP purpose, 250+ slots are reserved in case of sea creature battles or ship battles. Message me if interested in inquiring. Guild boat of \"Torchbug\\'s Light\".',['N']='The Hopeful Ship',},[110]={['O']=19896,['C']=1.047000,['D']='A Custom build farm heavily inspired from Oblivion, known for is creation of cheese and growth of crops. Mondragon family started a farm in the West Weald and decided to branch out in their growth! This small farm is known by the locals for Sheep cheese. They also have a Malthouse for helping the local brewers of the West Weald',['N']='Monarch Farms',},},}"
