R["oh__@hashii"]="{['na']={[48]={['C']=1.023000,['D']='A secret witch coven dedicated to Namira, the Daedric Prince of Hunger and the Mistress of Decay.',['N']='Namira\\'s Lair',['O']=19869,},[63]={['C']=1.050000,['D']='Merry New Life! Welcome Friends, let us feast and be warm by the fire during this cold winter. After a hard day\\'s work, the Moon and Stars Cottage offers a place to relax, cook, eat, drink, and play games. Also, it wouldn\\'t be New Life without presents to open! Not only that, there is a special guest downstairs, waiting to bless you for the upcoming New Year!',['N']='Moon & Stars Cottage',['O']=19178,},[30]={['C']=1.023000,['D']='\"There are rumors of something horrible in Mistveil Manor. The nobleman who lives there hasn\\'t been seen for months. My associates who went in there haven\\'t returned back, but the one who did claims a forest suddenly appeared as he walked in. The fog messed with his brain and he still hasn\\'t left the infirmary! What in the divines is going on in there?!\"\\n\\nA house controlled by Vaermina\\'s illusions and dreams~',['N']='Vaermina\\'s Illusions',['O']=18928,},[103]={['C']=1.500000,['D']='This build is dedicated to a clandestine sect of assassins, sworn in service to Mephala, The Lady of Whispers and the Webspinner, the Daedric Prince of murder and secrets. Within Hammerfell\\'s intricate political web, this guild\\'s influence reigns supreme, ensuring a constant stream of contracts. Whether it be silencing foes or stealing coveted secrets, no task is beyond their reach. With their renown comes a steep price, and they indulge in the spoils with unabashed opulence.',['N']='Mephala\\'s Assassins',['O']=19871,},[78]={['C']=1.500000,['D']='Proudspire\\'s Alchemy and Enchanting Store. Offers a diverse collection of alchemical instruments and ingredients on the main floor. In the basement, the store offers a crystal forge, enchanting store of various magical items, a custom magical research/crafting area. On the upper floor, the store offers a clockwork bits n\\' pieces, and a clockwork deconstruction/tinkerer office. Come shop today! ',['N']='Alchemy/EnchantStore',['O']=19177,},[69]={['C']=1.026000,['D']='Azura of the Crimson Gate: The Empress of Dawn and Dusk, the Mother Soul, the Moonshadow, the Queen of the Night Sky, the Twilight Queen, and the Cosmic Severer! You are the starlight that shape the Khajiiti way of life and destiny, guiding the fate of Elsweyr under the celestial canopy of Nirn. Azura, our luminous moonsugar, you weave the tapestry of our existence with threads of moonlight and shadow. We consecrate this temple, a sanctuary to your boundless splendor and celestial grace!',['N']='Temple of Azura',['O']=19880,},[70]={['C']=1.026000,['D']='\"Our lady, the moon and the stars, our creator, and the one who shaped us into being Khajiit. We must show respect to Lady Azurah and study Jone and Jode! We must preserve Khajiiti culture and transcend the limitations of this physical plane\"\\r\\n\\r\\n\\tWelcome to Rimmen\\'s Lunar Research Lab. Here, scholars and philosophers and researchers have everything they need - to explore, to meditate, to transcend, and even to relax. New initiates are welcome to join today!',['N']='Lunar Research Lab',['O']=19177,},[71]={['C']=1.037000,['D']='Temple of Alkosh is a grand complex dedicated to the worship of the Aedra and Daedra. Worshippers, Scholars, Historians, Kings, Queens, and just about anyone is welcome to this neutral Khajiiti territory to explore the higher dimensions of life. ',['N']='Temple of Alkosh',['O']=19176,},[94]={['C']=1.020000,['D']='A hidden underwater tomb blessed by Hermaeus Mora. An scholar and his late wife, after their travels and adventures, took retreat in this secluded magical area. Spending their lives dedicated to learning. \\r',['N']='Mora\\'s Blessings',['O']=19863,},[89]={['C']=1.030000,['D']='\"Welcome to Legacy of Tamriel Museum. A dedication to the glory and history to all of Tamriel and her people. Every culture has a representation to celebrate how far we have come as a society.\\r\"\\n\\r\\nThis house has been inspired by the Legacy of the Dragonborn mod from TESV:Skyrim.',['N']='Legacy of Tamriel',['O']=18953,},[74]={['C']=1.022000,['D']='Welcome to the Khajiiti Festival of Lights, a grand celebration paying homage to the luminous presence of Meridia: revered as The Lady of Infinite Energies, The Sunfire, The Radiant One, The Keeper, The Lady of Light, and The Harbinger of Dawn. Though not as ubiquitous in Khajiiti devotion, Meridia finds her rightful place of honor within this sacred temple. Here, the devout priesthood praise her as the vanquisher of darkness, heralding her with a symphony of light.',['N']='Meridian Festival',['O']=19873,},[90]={['C']=1.020000,['D']='Dagonic Insitute of Magical Research for war knowledge, and conjuration. \\r\\n\\t\\r\\n\\t(Don\\'t forget to look up at the ceiling for each of the 3 towers!)',['N']='DagonWarResearchInst',['O']=19177,},[55]={['C']=1.040000,['D']='Welcome to the Clockwork Cultural Exchange, for a night of mirth and whimsy in the heart of the wondrous city of gears and innovation!\\nAre you weary of the monotony of daily existence? Do the constant whirring machines and dull nutriment paste rob you of joy? Seek no further! Tonight, prepare to be astounded as Rigurt-The-Brash, renowned across planes and realms, takes center stage to regale you with tales from distant lands!',['N']='Clockwork Fancy Club',['O']=19877,},[64]={['C']=1.026000,['D']='Altmer scholars and mages visited Murkmire to study the local nature, alchemy, and enchanting. To establish relations with the locals, they established a university to cultivate the knowledge. Lakemire University blends altmer and argonian culture to provide a safe haven for higher knowledge in the mystic arts. ',['N']='Lakemire University',['O']=18840,},[46]={['C']=1.021000,['D']='Dibella\\'s Honeymoon Gardens is a private romantic estate owned by a wealthy noble and his loving wife. The estate offers a retreat away from the stress of politics and the outside world. The estate honors Dibella, and offers opportunities of artistic and passionate endeavors.',['N']='Honeymoon Gardens',['O']=19176,},[47]={['C']=1.023000,['D']='Just an innocent store with delicious sweet bread and fruits. They even have cake! Nothing nefarious behind the storage room!\\r\\n\\t\\r\\n\\t(There are 2 caves, 1 laboratory, a library, and a store)',['N']='The Sweetbreads',['O']=19177,},},['Key']='oh__@hashii',['Version']=1773,['TS']=1717688252,}"
