R["oh__@tellurion"]="{['eu']={[1]={['D']='',['N']='Nameless Hero',['O']=19843,['C']=1.029000,},[4]={['D']='After followers of Arkay were driven off, this humble shrine was abandoned until the scholars hungry for knowledge started gathering here various books and scrolls. Their bottomless hunger for information piqued interest with the God of Knowledge, Hermaeus Mora. He promised them to fulfill their hunger in exchange for their prayers and their souls. His priests gladly paid the price as the contract said and thus former Arkay shrine became The shrine of Hermaeus Mora.',['N']='Forbidden Knowledge',['O']=19812,['C']=1.029000,},[5]={['D']='The current owner has a good reputation among residents as a merchant, traveler, alchemist and a bit of a weirdo. He stays in seclusion and when he occasionally visits the local inn, it happens that he shares interesting and mysterious stories from his own, as he calls them \"business trips\". Many people think that most of them are made up, but only a handful of his friends, who often come to him for longer visits and some accompany him on his travels, know where the truth is.',['N']='Hunter business spot',['O']=19821,['C']=1.038000,},[6]={['D']='Rented apartman for argonian mercenary.',['N']='A Lil´Murkmire',['O']=19812,['C']=1.026000,},[7]={['D']='The strange home of I S\\'hee The\\'thees and his friend Lyranth. Both of them have neverending curiosity for mortals and mortality itself. And they will do anything to fill their hunger for knowledge and secrets of Nirn and this little house has every tool for it.',['N']='Kyn\\'s Home',['O']=19812,['C']=1.038000,},[8]={['D']='A busy crumpled library for dedicated researchers and magicians. Every seeker of knowledge is welcome.',['N']='The Humble Library',['O']=19812,['C']=1.025000,},[10]={['D']='Draws-With-Blood is skilled with alchemy and poisons, necromancy, and his hobby is of course drawing. He was born with the blessing of the Sithis so his path led him into the ranks of assassins. He is using his talents for various tasks that are sealed under the secret of the black sacrament. All he can reveal is that currently, he works as a diplomat between branches of assassins guilds across the Tamtiel: the Dark Brotherhood, Shadowscales, and Morag Tong.',['N']='The Spooky Sanctuary',['O']=19812,['C']=1.038000,},[14]={['D']='House of WW Bosmer Poisoned Toffee. When she was a pup, she found, under the influence of Lord Hircine himself, a part of the mysterious magic stone and was ordered to treasure it in exchange for protection for her and her pack. This stone gave this house its unique features and wild and magical sides, and it is the reason she can relax here so much with all of her pack family under the blessing of the Lord Hircine himself.',['N']='Magic gone wild',['O']=19812,['C']=1.026000,},[16]={['D']='The owner of this humble house had big plans to establish knick-knacks for the needs of every adventurer, scholar, or even an art collector. And of course, to made trades even more convenient, the bank was on reach, right above on the first floor. But the owner forgot that this city already having a bank and merchant conveniently placed few houses away. So now he is trying his best to win new customers and keep his regulars to somehow make a decent living for himself and his two loyal employees.',['N']='Knick Knacks',['O']=19812,['C']=1.049000,},[17]={['D']='The current owner has a good reputation among residents as a merchant, traveler, alchemist and a bit of a weirdo. He stays in seclusion and when he occasionally visits the local inn, it happens that he shares interesting and mysterious stories from his own, as he calls them \"business trips\". Many people think that most of them are made up, but only a handful of his friends, who often come to him for longer visits and some accompany him on his travels, know where the truth is.',['N']='Fell\\'s Run House',['O']=19821,['C']=1.038000,},[19]={['D']='Crystals, crystals everywhere.',['N']='Enchanter Emporium',['O']=19812,['C']=1.020000,},[22]={['D']='Hideout of maormer captain and her crew. She established this temporary land dwelling to search for and find clues about her half-brother who went missing on the land.',['N']='Maormer Hiding spot',['O']=19821,['C']=1.049000,},[23]={['D']='Are your paws tired and belly empty? Come chill and fill your stomach here, in the cozy atmosphere of this one small restaurant, yes? And if you are a fan of tea houses, this one has a dedicated area for you too. Please, welcome and enjoy the comfort of Purrs&Chill, tea&grill restaurant. May your road lead you to warm sands.',['N']='Purr&Chill',['O']=19842,['C']=1.024000,},[25]={['D']='What house of alchemist needs? Lots of ingredients, of course, fresh ones are preferred. And you find that here. The owner is a famous imperial alchemist and his collection of plants and mushrooms is known worldwide. If you need to get a rare potion or if you need to experiment on your own feel free to visit, but please, do not break something and keep the lab clean.',['N']='Alchemist Emporium',['O']=19812,['C']=1.031000,},[26]={['D']='',['N']='Late Stone Age',['O']=19812,['C']=1.031000,},[28]={['D']='When dragons awoke in the Elsweyr, members of the Dragonguards had to act quickly. They know that dragons will not stay only in elsweyr and to be able to fight them they need to train new members in every corner of Tamriel. And thus, the Riften Dragonguard hall was established with legendary dragon hunter Chirsari-daro as the head commander.',['N']='Dragons Hunters Den',['O']=19812,['C']=1.026000,},[29]={['D']='Nori Dumpling inherited Hot Dumpling\\'s inn from her late parents. She\\'s kinda silly, cheerful, honest, beautiful, and as every Nord up for the adventure. As the owner of the inn she often has to pack her bags and try to hunt for a good loaf of meat or gather berries for the family recipe mead for her customers, cuz a full belly makes happy Nord. In addition to housework and running inn, she still keeps in a form by occasional mercenary contracts or just by throwing knives when she is bored. ',['N']='Hot Dumpling Inn',['O']=19812,['C']=1.051000,},[31]={['D']='',['N']='Mighty Cat Pub',['O']=19827,['C']=1.024000,},[32]={['D']='House of Gonna Gra-Sthemall, orc warrior and mercenary. She left her family after a fierce argument about her future and resentment of the traditional ways of her tribe. She earned her living by seeking adventures as a mercenary and soon enough word got around about her and her skills. Hard work paid off, and for now, she can take a break while farming and gardening, but she will not let her sword get rusty. She never knows when another adventure will come.',['N']='Bhazzul House',['O']=19821,['C']=1.051000,},[34]={['D']='Calesannah de Odor Morda, a Redguard necromancer, lived in an ordinary house near the bustling city of Hallin\\'s Stand. The house, unassuming and modest, concealed a secret. Through the back door lay her secret workshop, filled with ancient tomes, glowing crystals, and vials of mysterious substances. By day, she was a respected herbalist, but by night, she studied the forbidden arts, striving to master necromancy. Her dual life was a delicate balance, hidden from all but the most trusted allies.',['N']='de Odor Morda',['O']=19869,['C']=1.038000,},[35]={['D']='You surely know the legendary treasure hunter Falion L\\'eki. No? Really? Anyway, welcome to his little inn. He establish it after he gathered enough gold from his adventures and now he is using it as his base for trading and of course to moisture dry throats of his regular customers. For those who need it, there are even free beds for the night\\'s peaceful sleep before venturing into the Alik\\'r Desert.',['N']='Sentinel House',['O']=19812,['C']=1.011000,},[100]={['D']='Lil necropolis',['N']='Necrom Inn',['O']=19821,['C']=1.029000,},[37]={['D']='After a long time of searching and digging, the secret Magic Market, in the bowels of the magical cave, was finally uncovered and opened.\\r\\nHere you will find merchants offering everything related to occult practices, fortune telling, crystal divination, astronomy, and more. At the same time, the Magic Market pub is also close at hand, where there is a place to conclude various agreements, exchange magical artifacts or relax in the magical atmosphere of the Endless Waterfall.',['N']='The Magic Market',['O']=19842,['C']=1.020000,},[38]={['D']='Enjoy a stroll through the garden and glimpse the intricate process of crafting, storing, and distributing our wines. Inside, indulge in a wine-tasting event showcasing all our unique varieties. Despite its modest size, this vineyard yields a bountiful harvest each year, prompting speculation about its secret to success. Even Mr. Thunderboots came to investigate this rumor. Will you join him in unraveling this mystery, or would you prefer to unwind with wine and delightful conversation?',['N']='Daenia Dolmen Manor',['O']=19864,['C']=1.026000,},[39]={['D']='Low gamma and first-person are recommended. Don\\'t be afraid if you have an honest heart. House of Lilabati the Disobedient, necro vamp healer - that creepy monster who lurks in the dark for sinful souls. She will not hesitate to take over any evil creature and plays with it until satisfied. She sometimes helps desperate people, end evil deeds, and is not afraid to punish by death those who hurt innocent. But on the other hand, she can also heal you or give you the right potion for your problem. ',['N']='Sweet Webs',['O']=19812,['C']=1.038000,},[104]={['D']='Twinkling Sanctuary stands as a testament to the harmonious marriage of nature and magic. Its structure, seemingly grown rather than built, intertwines seamlessly with the surrounding flora, adorned with vibrant vines and blooming flowers.  Within this magical haven, the magician resides, his domain a sanctuary where spells are woven, potions brewed, and the secrets of the arcane whispered to those who dare to seek its wonders.',['N']='Twinkling Sanctuary',['O']=19864,['C']=1.020000,},[44]={['D']='Winter joy all year around! ',['N']='Winter Market',['O']=19812,['C']=1.022000,},[78]={['D']='Here lives the warrior of Thane of Solitude, Gundyr Winter-foot, head of the Winter-foot clan. As a proud Nord, he displays his adventures, his trophies, and his faith in his house. And as a true Nord, he has always food and mead at the ready for him and his friends. If you are up for an adventure, you can join his party and discuss the plan for the next venture by the round table upstairs and prepare some armor, weapons, or potions for the upcoming quest.',['N']='Thane Warrior',['O']=19821,['C']=1.051000,},[47]={['D']='When Molag Bal invaded Tamriel, warriors defeated his anchors on the land. At the same time, he accidentally summoned a few of his anchors right into the Eltheric Ocean and pulled a big piece of it into his realm. This place was discovered by Nénar Kal and scholars from Mages University and created an underwater promenade. So take a deep breath, and you can explore hidden treasures. For the fearless, there is an opportunity to explore the deepest parts of it.',['N']='Under the Sea',['O']=19812,['C']=1.012000,},[81]={['D']='Welcome to the Sorber Horker hero! Need a shelter? We have free rooms! Is your stomach empty and mouth dry? We have everything to please your tastes! Homemade mead and fresh ingredients for the cooking and comfortable rooms make our inn the perfect spot to stop before and after every adventure! Every adventurer is welcome. Singed: Nori Dumpling, the inn owner. P. S: Behave yourself, no fights or destroying property! Otherwise, our guard will give you a quick lesson on how to swim in the lake! ',['N']='Sober Horker',['O']=19812,['C']=1.051000,},[82]={['O']=19821,['N']='The Never-There',},[36]={['D']='Little port village for seekers of knowledge and travelers across the mundus and other realms. They can rest, share stories, seek new information, and trade items collected into the mundus and other planes. This place is under the protection of Azandar, an arcanist who is chasing fate itself.',['N']='Port Hunding House',['O']=19812,['C']=1.041000,},[87]={['D']='',['N']='Into the Oblivion',['O']=19827,['C']=1.038000,},[71]={['D']='This one is recommending visit this shrine, especially if you seeking inner peace and wealth. And maybe not just that the spiritual one, sneaky khajiit knows what he talks about. Just go there and have your soul and eyes open and gods will give you a sign.',['N']='A humble temple',['O']=19812,['C']=1.041000,},[58]={['D']='The first apartman of the young khajiit Sir Meowximus Purrime adopted by pair of Altmers.',['N']='Snob Room',['O']=19812,['C']=1.049000,},[90]={['D']='*Do not miss the second floor behind the entrance portal* House of the khajiit daedrologist Dar\\'mrissi who got sucked up too much into her field of study and started to share this little piece of land with some friendly-ish (towards her) daedras. All daedras are welcome, all your needs will be meer (torture room included).',['N']='Deadlands Place',['O']=19812,['C']=1.038000,},[59]={['D']='House of Sir Meowximus Purrime. He was adopted as a stray kitten by altmer pair. And when they found out that he is not a cat but khajiit, they decided to adopt him and raise him...as a proper altmer. He created here his own kingdom for comfortable living in the altmer town. In the backyard, he let live his kin-friend Lotlurien-daro, a legendary adventurer, under the promise that she will learn him how to become legendary as well. But for now, just enjoy this comfort for a while, right?',['N']='Hidden Cat Retreat',['O']=19812,['C']=1.051000,},[70]={['D']='House of the pirate captain Raevina Melle Manantem and her crew. She is an imperial deserter who ran away from the Three Banners\\' War after her parents were killed. She is blessed by the \"call of dragon blood\" and this gift resonates strongly as dragons reappeared in Elsweyr. Her interest in dragons made her stays longer on the land so she and her crew managed to create a shelter for every person in need to stretch his legs, relax and make some golds hidden from the eyesight of the government.',['N']='Azra\\'ri: Pirate Town',['O']=19812,['C']=1.041000,},[49]={['D']='Locals tend to avoid the ruin of the old Motchad chapel, saying that weird energy is gathered there and in the night even the ominous aura is glowing from there. They noticed, that an odd hermit calling herself Guardian of the Green started to live there. She does not seem evil but everyone feels that she is best to keep her as an ally. Rumors say that she can bend the old, raw magic for the good deeds but for the bad deeds either. What is truth and what is just a myth of scared townfolks?',['N']='Old Motchad Chapel',['O']=19812,['C']=1.038000,},[62]={['D']='In the shade of Psijic University a little town of Mawa can offer many thing for every promising students of magic what they might need. Residents are quiet and friendly so come to visit. Everyone is welcome:\\r And if you are wondering: Am I capable to become a student of the Psijic University?, the entrance exam is simple for those who are gifted: just try to pass through the magic barrier. If you do, you can enter the restricted area of the University itself and fulfill your potential. ',['N']='Mawa University Town',['O']=19812,['C']=1.041000,},[95]={['D']='Room of unknown painter.',['N']='Artisan Studio',['O']=19812,['C']=1.045000,},},['Version']=1773,['Key']='oh__@tellurion',['TS']=1716742716,}"
