R["fx__na__@altairmatiusvt__2"]="{['Version']=1773,['TS']=1714685389,['Effects']={[1]={['Id']=1035,['SizeY']=35,['Roll']=0,['X']=22535.733199,['Y']=20196,['EffectType']=8503,['Contrast']=1,['Pitch']=4.715880,['SizeX']=26.456456,['SizeZ']=35,['Color']=102439,['MetaData']={['title']='Altair\\'s Journal',['message']='[Inside this book are a number of mundane entries, but a few stick out to you.]\\n\\nTurdas, First of Mid Year, 2e 283,\\nOrdered a modified soul gem and Dwemer Convector from the Soul Mage. Nehelenia, I think her name was. Pleasant enough, better than half the others by a long shot.\\n\\nLoredas, Third of Mid Year, 2e 283,\\nThe mad khajiit is dealt with. Bastard was sacrificing his fellow khajiit, and convinced himself he was an altmer, perhaps to cope? Either way, we burned his body to prevent any necromancy. I hope that\\'s the last of it.\\nAddendum: I was promoted to Acting Commander of the Direnni Guard! I\\'ll do my best to live up to this honor, and the duties that it places upon me.',},['Groups']=0,['Z']=26766.585451,['Alpha']=1,['Yaw']=0.073304,},[2]={['Id']=1037,['SizeY']=30,['Roll']=0,['X']=22077.187117,['Y']=20146,['EffectType']=8503,['Contrast']=0.320000,['Pitch']=4.757768,['SizeX']=26.456456,['SizeZ']=30,['Color']=10852,['MetaData']={['title']='Altair\\'s Research Notes',['message']='[Inside are detailed notes about Altair experimenting with a hybridized form of alchemy, paired with soul magic. He appears to be testing some sort of medicine that could forcefully cure someone of lycanthropy or vampirism, to disable opponents before the battle even begins properly.]',},['Groups']=0,['Z']=26843.403838,['Alpha']=1,['Yaw']=2.225295,},},}"
