R["fx__eu__@lotlurien__82"]="{['Version']=1773,['TS']=1702367395,['Effects']={[1]={['X']=28650,['SizeZ']=100,['Z']=95576,['Pitch']=5.497787,['EffectType']=4401,['MetaData']={['message']='\"You know what would be a good sign?\"\\n\"Free Sweetrolls! Who wouldn\\'t like that?\"',},['Roll']=0.785398,['Yaw']=6.270968,['Id']=1200,['Groups']=0,['SizeY']=100,['SizeX']=360,['Contrast']=3.060000,['Alpha']=1,['Color']=992374,['Y']=21660,},[2]={['X']=29482,['SizeZ']=60,['Z']=97806,['Pitch']=5.759587,['EffectType']=4401,['MetaData']={['message']='\"I suppose an introduction is in order. \\nI\\'m Sheogorath, Prince of Madness. \\nAnd other things. \\nI\\'m not talking about them.\"',},['Roll']=0,['Yaw']=1.364847,['Id']=1202,['Groups']=0,['SizeY']=60,['SizeX']=340,['Contrast']=1,['Alpha']=1,['Color']=992994,['Y']=21738,},[3]={['X']=26732,['SizeZ']=60,['Z']=99443,['Pitch']=0,['EffectType']=4401,['MetaData']={['message']='\"Wonderful! Time for a celebration... Cheese for everyone!\"',},['Roll']=0,['Yaw']=2.611013,['Id']=1203,['Groups']=0,['SizeY']=60,['SizeX']=680,['Contrast']=1,['Alpha']=1,['Color']=991269,['Y']=22672,},[4]={['X']=28333,['SizeZ']=60,['Z']=98302,['Pitch']=4.974188,['EffectType']=4401,['MetaData']={['message']='\"Ask? ASK? I don\\'t ask. I tell.\\nThis is My Realm, remember?\\nMy creation, My place, My rules.\"',},['Roll']=0,['Yaw']=5.841617,['Id']=1204,['Groups']=0,['SizeY']=60,['SizeX']=460,['Contrast']=1,['Alpha']=1,['Color']=992898,['Y']=21475,},[5]={['X']=26463,['SizeZ']=40,['Z']=98932,['Pitch']=5.235988,['EffectType']=4401,['MetaData']={['message']='\"Once you understand what My Realm is, \\nyou might understand \\nwhy it\\'s important to keep it intact.\"\\t\\n',},['Roll']=0,['Yaw']=0.963422,['Id']=1205,['Groups']=0,['SizeY']=40,['SizeX']=300,['Contrast']=1,['Alpha']=1,['Color']=991988,['Y']=21357,},[6]={['X']=28049,['SizeZ']=60,['Z']=102416,['Pitch']=5.585054,['EffectType']=4401,['MetaData']={['message']='\"Another Daedric Prince. Not a nice one. I don\\'t th