R["oh__@beezenees"]="{['Key']='oh__@beezenees',['na']={[16]={['C']=1.026000,['O']=19692,['D']='A cozy abode for the Historian. Features reskinned walls, a loft, a kitchen, plenty of books and artifacts, and a bathroom. \\n\\nThanks for visiting!',['N']='Cozy Historian',},[17]={['C']=1.031000,['O']=19641,['D']='A reskin of Ravenhurst into an abandoned dunmeri/tribunal shrine',['N']='overgrown dunmer shr',},[43]={['C']=1.031000,['O']=19009,['D']='Color (blue, green, purple) based nature themed exterior cave reskin of Amaya Lake Lodge. \\nNo interiors, and it\\'s not really meant to be a \"fully functional build\". It\\'s just a pretty, chill, spot. Come visit and relax!',['N']='Azure Nature Cave',},[44]={['C']=1.026000,['O']=19648,['D']='A historian\\'s nature-filled getaway! Near full restructure of Ald Velothi. Features a re-imagined entrance, a library, a kitchen, and a bedroom. Thanks for visiting ^^',['N']='Historian\\'s Getaway',},[101]={['C']=1.020000,['O']=19524,['D']='A reimagining of the new Emissary\\'s Enclave home into a magical nature alchemical cave getaway.',['N']='Alchemist\\'s Hideaway',},[61]={['C']=1.500000,['O']=19678,['D']='Just a cozy cabin to hide away from it all! \\n\\nPlease ignore entrance and make your way through the portal ^^',['N']='Stoic\\'s Hideaway',},[25]={['C']=1.500000,['O']=19697,['D']='An experimental reskin/rebuilding of a basic crafting area utilizing Khajiit temples and overall theme. It\\'s where I port to when I want to do some basic crafting.',['N']='Temple Craftorium',},},['TS']=1701888090,['Version']=1773,}"
