R["fx__eu__@strike4__5"]="{['Version']=1773,['TS']=1698476863,['Effects']={[1]={['MetaData']={['message']='Blicke verfolgen mich, sie sind überall um mich herum. Wer beobachtet mich? wer ist da im dunkel?. Sie starren mich an, starren mit unbeweglichen Augen, was habe ich getan? warum verfolgen sie mich?.\\nIch höre Schritte, zuerst leise, fast unhörbar, unterbrochen durch stille, dann lauter, hinter mir, näherkommend. Wenn ich mich umdrehe ist da niemand oder etwas zu sehen. Das Dunkel verschlingt alles, und zeigt neues, unheimliches. Schatten am Boden, Schatten an den Wänden, Schatten, die sich verändern. \\nDas Dunkel greift nach mir, die Schatten werden drohender. Meine Blicke werden ruhelos, die Blicke um mich herum auch. Ich sehe ein Gestalt im Dunkel, oder ist das nur ein Schatten?.\\nDie Nacht scheint endlos, meine Gedanken schreien in die Schwärze um mich herum, und in mich hinein. Ich falle, falle immer tiefer, in meine Gedanken, in das Dunkel.\\nBin ich allein? \\n\\nEyes in the dark\\n\\nGazes haunt me, they\\'re all around . Who is watching me?, who is there in the dark? They stare at me, stare with immobile eyes. What have I done? Why are they chasing me?\\nI hear footsteps, at first soft, interrupted by silence, then louder, behind me, approaching. When I turn around, there is nobody or something to be seen.\\nThe dark devours everything, but also show something new. Shadows on the floor, shadows on the walls, shadows that change.\\nThe darkness reaches for me, the shadows become more threatening. My gaze becomes more restless, as does the gazes around me.\\nI see a figure in the dark, or is it just a shadow? The night seems endless, my thoughts scream into the darkness around me, and inside me.\\nI\\'m falling, falling deeper and deeper into my thoughts, into the dark.\\nAm I alone?',['title']='Augen im Dunkel / Eyes in the dark ',},['X']=25525.376278,['EffectType']=8502,['SizeX']=33.456456,['Z']=26283.771130,['Id']=1684,['SizeZ']=39,['Alpha']=0.260000,['SizeY']=39,['Groups']=0,['Roll']=0,['Contrast']=1,['Pitch']=5.256932,['Color']=24802,['Y']=20228,['Yaw']=3.117158,},[2]={['X']=25555,['EffectType']=865,['Z']=26167,['Y']=20664,['Yaw']=2.979277,['Color']=998276,['Contrast']=1.610000,['SizeY']=630,['Groups']=0,['Roll']=0,['SizeX']=1320,['Pitch']=1.570971,['SizeZ']=630,['Alpha']=0.590000,['Id']=1726,},},}"
