R["oh__@thepageofcups"]="{['Key']='oh__@thepageofcups',['na']={[49]={['O']=19280,['N']='The Sunken Selkie',['C']=1.007000,['D']='Located along the north-eastern Hag Fen coast, this small tavern offers a refuge for travelers along the road. Now decorated for the season! ',},[89]={['O']=19280,['N']='Chateau de Lille',['C']=1.007000,['D']='Located across the bay from Evermore, this castle ground is open to the public for refuge along their travels. Commonly accessed via ferry available at the Evermore harbor. Features a church of the Divines (emphasis on Mara), hospital, market, ale garden, and small crafting area. ',},[34]={['O']=19280,['N']='Abah\\'s Landing Loft',['C']=1.007000,['D']='A loft apartment, located in Hew\\'s Bane. ',},[83]={['O']=18989,['N']='Bishop\\'s Landing',['C']=1.007000,['D']='A penthouse mansion, owned by some eccentric antiquarian. ',},[28]={['O']=19301,['N']='Healer\\'s Cottage',['C']=1.007000,['D']='A small healer\\'s cottage, located somewhere in Skyrim. ',},[76]={['O']=18989,['N']='Tu\\'Whacca\\'s Folly',['C']=1.007000,['D']='Located in southern Bangkorai, this settlement is nestled safely between long-forgotten Yokudan ruins. Features a market, tavern with stage, hostel-like lodging, a poolside library, and various lounge spots.',},[30]={['O']=19398,['N']='The Cheeky Muse Inn',['C']=1.007000,['D']='This little compound in the north features a sheltered market, caravan camp, ale garden, and inn. ',},[71]={['O']=18989,['N']='Mazadi\\'s Rest',['C']=1.007000,['D']='Located a day\\'s travel from Black Heights in Southern Elsweyr; this small camp offers shelter among long-forgotten ruins. The camp appears to be lead by alfiq twins; Mazadi the Banker, and Fezis the Merchant. ',},},['TS']=1676070784,['Version']=1771,}"
