R["fx__na__@dreamlaka__8"]="{['TS']=1675446544,['Effects']={[1]={['Roll']=0,['MetaData']={['name']='Namira',['message']='Dream.. she will be kept safe my friend. Anything that will disturb the shadows you create, the light you hold. They will feel the crawling darkness',},['SizeZ']=220,['Y']=20115,['Color']=999999,['Contrast']=1,['Z']=21783,['Pitch']=0,['Alpha']=0,['SizeY']=220,['SizeX']=90.378378,['Groups']=0,['Yaw']=4.501204,['EffectType']=5079,['Id']=1017,['X']=23572,},[2]={['Roll']=0,['SizeY']=1000,['SizeX']=1000,['X']=23928,['Contrast']=1,['Groups']=0,['Y']=20008,['Alpha']=1,['Id']=1020,['SizeZ']=1000,['Pitch']=0,['Yaw']=1.570796,['EffectType']=1006,['Z']=22598,['Color']=999999,},[3]={['Roll']=0,['MetaData']={['title']='The List.',['message']='-The book seems to show signs of magic yet the pages are. . . blank.',},['SizeZ']=30,['Y']=20120,['Color']=102439,['Contrast']=0.250000,['Z']=22005.651322,['Pitch']=4.981170,['Alpha']=1,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['Yaw']=4.478515,['EffectType']=8502,['Id']=1021,['X']=23766.515294,},[4]={['Roll']=0,['MetaData']={['title']='Wonders with the spirit, the effect of alchemical effects AD.',},['SizeZ']=30,['Y']=20107,['Color']=41323,['Contrast']=0.250000,['Z']=22685.269147,['Pitch']=4.736824,['Alpha']=1,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['Yaw']=1.570796,['EffectType']=8501,['Id']=1023,['X']=22824.506859,},[5]={['Roll']=0,['SizeY']=30,['SizeX']=26.456456,['X']=23268.369912,['Contrast']=1.500000,['Groups']=0,['Y']=20027,['Alpha']=1,['Id']=1025,['SizeZ']=30,['Pitch']=6.021386,['Yaw']=2.474877,['EffectType']=904,['Z']=22454.384708,['Color']=4,},[6]={['Roll']=0,['SizeY']=600,['SizeX']=182,['X']=22630.030003,['Contrast']=0.010000,['Groups']=0,['Y']=20138,['Alpha']=0.500000,['Id']=1027,['SizeZ']=600,['Pitch']=0,['Yaw']=5.291838,['EffectType']=4589,['Z']=23992.704319,['Color']=99,},[7]={['Roll']=0,['MetaData']={['title']='My loss and My promise. . .(p2)',['message']='Worse yet. . you didn�t tell me that we had a baby girl on the way. . . the tears were not only for you slipping away, I told you I�d bring you back if something happened to you and you did not worry, but those tears were because of the child.\\n\\n     The Daedra that I find, the ones who poisoned you will feel everything of that darker side of myself, the side of myself that was driven out due to the light, the warmth and the love you gave me and yet, now without it. Everyone that was involved with your death will pay.\\n\\nYou and to my unborn will have my love forever and always, I will see you both again and I will promise. NO DIVINE NO DAEDRA WILL BIND YOU, Nothing from the children of Anu and Padomay, No one will use you two or even try to take you from me. I refuse to let a power that I cannot guarantee the full health and revival of you two, resurrect or defile who you are.\\n\\n        I hope you will forgive what I will end up doing to the Nine that turned their backs on us, who tried to use you against me. A few Daedra I know and trust will guard you two. The times with this Molag will not take you, even the others that are against me or have alternative motives. . . I will leave nothing left, they wanted a monster so they will get one.\\n      Forever your dreaming Drem La Ka ',},['SizeZ']=30,['Y']=20037,['X']=23557.053427,['Contrast']=1,['Z']=22028.528367,['Pitch']=4.680973,['Alpha']=0.010000,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.745624,['EffectType']=8501,['Id']=1028,['Color']=102439,},[8]={['Roll']=0,['MetaData']={['title']='My loss and My promise. . .(p1)',['message']='      The sickness took you, THE NINE DID NOT HELP YOU.\\n\\n Talos � \"Hero-god\" of Mankind did not hear my plea over and over to somehow find the ones that already poisoned you, the only voice I heard back was one of disappointment due to my nature as a Necromancer and a Elder Lich. . . Nothing of my Alchemical knowledge would help you, nothing of my magic would heal you. The hint to the people who could have treated the poison that I did not know right away due to the shock and panic of my light, You, My lana. It was Daedric poison. . . \\n\\n     Talos did not help me find them, you were mortal, born from Aedra tho as they would be past ancestors. . . I feel as if it was my nature he did not help and because you were a woodland Elf mixed with High Elven blood. Then we get to Akatosh � the Dragon God of Time and chief god of the pantheon or how I refer to him as the first born of Anu. That prideful bastard would have you bound to his will in order to keep me in line, TO USE YOU. Never. . . He will also be on the list.\\n\\n      Then we have Arkay � God of the Cycle of Life and Death, He tried to help, I have never acted like these Necromancers of today, sacrifice in the name of blood and research, never have I been known in the past as a dark Necromancer but rather as someone who helped healed and guided the souls or have the lost love ones to say the final goodbyes. I believe that is the only reason why he tried to help yet there was nothing he could do. . . even Kynareth cried for you and I.\\n\\n      Arkay was the one who calmed myself down and made me realize that it was Daedra poison but close to when I was able to save you, it was too late. The tears you shed on that day and the pain in that voice, that was a melody for my light, was crumbling.  ',},['SizeZ']=30,['Y']=20048,['Color']=102439,['Contrast']=1,['Z']=22013.675057,['Pitch']=4.928810,['Alpha']=0.010000,['SizeY']=30,['SizeX']=26.456456,['Groups']=0,['Yaw']=5.658357,['EffectType']=8501,['Id']=1029,['X']=23506.217378,},[9]={['Roll']=0,['MetaData']={['title']='The List',['message']='Akatosh- Repay in kind...\\nTalos- Repay in kind...\\nPeryite- Knowlage on the poison, not his.\\nMolag.- I will steal from him to what he tries to take from me and repay that onethousand times over.\\nDagon- seems we have a understanding to avoid one another with our work of late, out of respect I should offer him something. After I get this done.\\nNocturnal- neither in my way or trying to stop me.\\nSanguine- More friendly than harming myself, Prince offering help to calm down the nerves and even shows sadness for me. I will take him up on his offer for that drink later...\\nSheogorath- Need to tell uncle \"Sheo\" to calm down with the book and the odd cheese wheels that glow, still taste good.\\nVaermina- Will not respond, I will have to look into this if she is the one who  put a target on my wife and unborn. for het followers and temple I hope she will answer my summons soon. .\\nAzura- Somber,when she speaks of my Lana. I will look into this further.\\nY\\'ffre- His voice is filled with pain and anger, he is with me on trying to find the \"who\" that went after my beloved even knowing she has High Elf blood in her. My respect grows with him, as does my thanks.\\nBoethiah- not important.\\nClavicus Vile- A bother to talk to and to keep at arm\\'s length. If I hear another \"offer\" or \"deal\" from the prince I will put up those wards.\\nHermaeus Mora- One of my Teachers and Friends. Tells me a \"Fog\" or \"blindness\"  acts on him when he tries to help. Further knowlage is needed.\\nNamira- A Friend, over protective towards myself at times and my wife when. . .she was with the living. . she has the same Hate and Rage within her as I, warped a shrine for her to help with the process.\\n  For now the others not listed are of no importance..',},['SizeZ']=46,['Y']=20108,['Color']=102439,['Contrast']=0.250000,['Z']=23913.443117,['Pitch']=4.705408,['Alpha']=0,['SizeY']=46,['SizeX']=35.456456,['Groups']=0,['Yaw']=3.256784,['EffectType']=8502,['Id']=1030,['X']=22947.787536,},},['Version']=1771,}"
