R["oh__@lyranth"]="{['TS']=1671251839,['Key']='oh__@lyranth',['Version']=1771,['eu']={[37]={['O']=19041,['N']='S\\'ren-ja Manor',['D']='Lovely little high class broth.. hotel for luxurious getaway for those seeking anonymous stay =))',['C']=1.028000,},[55]={['O']=19337,['N']='Clockwork Laboratory',['D']='My main with Dwemer & Clockwork vibes. All crafting stations, mundus stones etc, also portals to/from my other open houses as well! Hope to see you snoopin \\'round =))',['C']=1.010000,},[72]={['O']=18985,['N']='Necromancer Lair',['D']='A dedicated museum for grotesk horror througout the Elder Scrolls World. Enjoy the stories - and be sure to have a selfie in the electric chair.. just don\\'t touch the switch while you\\'re at it!',['C']=1.023000,},[15]={['O']=19029,['N']='Cormount House',['D']='Visit the Sanctuary of dem old days of the Green Pact, pay your respects, have something to eat, take a good rest and continue your adventuntes around Tamriel. We wish you well =))',['C']=1.029000,},[75]={['O']=19035,['N']='Wrothgar Village',['D']='Enjoy your visit at our well guarded sea elf harbor, visit the long house and have smth to eat. Take a good rest. Wash your clothes and have a bath. Need more solitude? There\\'s a cave you can use.. time to relax =))',['C']=1.018000,},[44]={['O']=19337,['N']='Redoran Home',['D']='An ex Morag Tong member, skilled alchemist who went bonkers. Eventually her experiments got out of hand and she got exiled. You can still see some the remains of her vile experiments!',['C']=1.026000,},[23]={['O']=19343,['N']='Rawl\\'kha House',['D']='An unassuming hide out near Rawl\\'Kha. A secret lair where Quis Quis brings only her most trusted business customers to taste the finest Redwater Skooma ever created. That, of course after she has pampered them over at Serenity Falls.. no worries, should the authorities acccost you, there\\'s also a fast getaway, seek it out!',['C']=1.007000,},[78]={['O']=19035,['N']='Solitude Townhouse',['D']='What in the world happened here? Former owner gone missing, now the new owner disappeared as well - and the house is in chaos! There\\'s definitely smth evil going on in here.. better walk away. Know nothing, see nothing. Proudspire? Never heard.',['C']=1.038000,},[63]={['O']=19341,['N']='New Life Snow Globe',['D']='Maid\\'s little Winter Wonderland, a weekend retreat away from her sinister business duties! Loads of games and activities, plenty of food and at the end, if you will, relax in our sauna and have a swim!',['C']=1.022000,},},}"
