Pitch']=0,['SizeX']=47000,['X']=115551.578066,['Z']=130344.179360,},[9]={['SizeZ']=30100,['Groups']=0,['Alpha']=1,['Y']=0,['EffectType']=899,['Roll']=0,['Id']=1992,['Color']=0,['SizeY']=30100,['Contrast']=0.320000,['Yaw']=0,['Pitch']=0,['SizeX']=38100,['X']=0,['Z']=0,},[10]={['EffectType']=8501,['SizeZ']=30,['Roll']=0,['X']=103293.615148,['Y']=33700,['Groups']=0,['Id']=2008,['SizeY']=30,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=3.796091,['Pitch']=1.047198,['SizeX']=26.456456,['MetaData']={['message']='As the reader would gaze at the book, those who could not read Daedric script would only see incomprehensible symbols.  Those who could, would read pages upon pages of detailed Daedric rituals, interestingly, devoted to combined Daedric Princes instead of to a single Prince.  There would be rituals for Mephala, Meridia, Nocturnal as well as some lesser Princes.  Each combined in various combinations according to what the caster was attempting to accomplish.  It would appear that, whomever created the text thought if one Prince was good.. combining several for the various magics.. would somehow be.. better.  \\n\\n\\n\\nThe symbols for the title, translated as Control of Fools, indicated that the spells were intended to be given to the Ayleids.  There were many accoutings of the spells having been successfully cast and that the Princes were pleased at the combinations.  \\n\\n\\n\\nOne particular spell which called upon Meridia and Mephala, was for what was described as a spell of protection.  It would form a rune circle, to be cast on the ground.  However, the reader might notice that a few very simple seeming but at a deeper level critically important symbols were... entirely wrong for a protection spell.  That... if performed as it was written it would instead teleport an object or a creature through any boundaries.     \\n\\n\\n\\nThere were further scripts that clarified this ritual had been approved by both Princes it invoked.  \\n\\nSurely the Princes\\' cooperation with the weilder was implied.\\n\\n',['title']='((Daedric))  Control of Fools',},['Z']=122380.939039,},[11]={['EffectType']=8501,['SizeZ']=30,['Roll']=0,['X']=108483.487600,['Y']=39203,['Groups']=0,['Id']=2009,['SizeY']=30,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=5.878269,['Pitch']=5.323254,['SizeX']=26.456456,['MetaData']={['message']='This books was one of rrecounting of all that the Nedes went through at the hands of the Ayleids to please their Daedric Princes.  \\n\\n\\n\\nIn reading it, it would be difficult to tell if the writer had wirtten all of the accountings out of pity for the Nedes or a sick fascination with what had been done to them all supposedly in the name of scientific research that would \"help\" the tribes of Nedes.  That \"help\" clearly consisted of sterilizing some of them, creating an army for others, and still others for experimentation of setting human children on fire, making sculptures out of human bones, making gardens out of human entrails, creating flesh sculptures out of them and general sacrificing of slaves.\\n\\n\\n\\nThere were also detailed notes around making the Nedes into superhumans that could be controlled using certain mushrooms.  It detailed proportions for the potions, how they were injected, and how to retain mental control over them at distance.  \\n\\n',['title']='((Nedic))  Controlling the Nedes',},['Z']=125160.866819,},[12]={['EffectType']=8501,['SizeZ']=30,['Roll']=0,['X']=119789.342034,['Y']=98071,['Groups']=0,['Id']=2010,['SizeY']=30,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=3.895575,['Pitch']=5.497787,['SizeX']=26.456456,['MetaData']={['message']='From the cover of the book it would seem this journal had been one used for Ayleid research of creating various slave races, Nedes being the primary focus, into superhuman armies that retained a docile, controllable nature. \\n\\n\\nInside the cover, each page had been ripped out, shredded and covered in what appeared to be fresh acid of some sort as it lay on the floor, rendering the text entirely unreadable.   ',['title']='((Ayleid Translation))  Experimentation in Servitude Excellence',},['Z']=128640.535550,},[13]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['X']=110074.867778,['Y']=33688,['Groups']=0,['Id']=2013,['SizeY']=70,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=4.408702,['Pitch']=1.570971,['SizeX']=66.456456,['MetaData']={['message']='\\nMoontiki- Written from the sixth month of the last year of the last era to the ninth month of the last year of the last era\\n\\nEntry 1\\n\\n\\n\\npages of sketched nuts fill the first 5 pages of the book followed by 3 pages of nicely written tavern songs and simple sketch of Alari\\n\\n\\n\\n3 pages are folded neatly and tucked into the next page\\n\\npage one\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\npage two\\n\\nthis one stole the book from the woody elfs. this one is smart. this one wishes there were more pictures. this one will color more. this one keeps the wood elf away with a big ax. this one thinks a silly wood elf thinks it in not a wood elf. this one also things the woody elf needs glasses. this one wonders why it thinks this one is not a khakiit. this one is sad. the wood elf friend left. this one liked friendly elf but the friendly elf left after i threw my big ax at it. this one wants pretty elf with scales to come back. this one loves the lightning divine. we will wed. love my lighting divine. give Moontiki scales of fishies too. this one thinks it will catch the dwemer bug. dwemer bug looks tasty.\\n\\n\\npage three\\n\\nCharred one? charred one? does this one look like charred one? Mooktiki will share glasses. glue them to woody elf who does not think it is a woody elf. this one is sad. the elf came back and tried to give this one a new book to trade. this one does not want a new book. it likes the one with pictures. It tries to bribe me with pictures. i want this one. it has many words in it too. it can have new book....\\n\\n\\n\\n\\nThis one has the beautiful lightning divine in a pretty new book \\n\\nEntry 2\\n\\n\\n\\nthis ones digs for the hollows! Moontiki will win the glory!\\n\\n\\nEntry 3\\n\\n\\n\\nThis one danced words with the storm Devine. Moontiki does not usually like devines, but this one is mad like old Moontiki. <3\\n\\n\\n\\n\\n\\n\\n',['title']='Tales of Moontiki (Vol. 1)',},['Z']=124937.505887,},[14]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=110122.871810,['Y']=33694,['Groups']=0,['Id']=2016,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=4.379031,['Pitch']=0.174533,['SizeX']=140,['MetaData']={['message']='Tales of Moontiki  Vol. 1\\n',},['Z']=124963.029085,},[15]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['X']=116336.695866,['Y']=49801,['Groups']=0,['Id']=2017,['SizeY']=70,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=3.670427,['Pitch']=1.570971,['SizeX']=66.456456,['MetaData']={['message']='((Scribbled randomly with no rhyme or reason:))\\n\\n\\n\\nThis one found a Little Moontiki to care for. Moontiki will raise it well.\\n\\n\\n\\n\\n\\n\\n\\nMoontiki\\'s head is bloody. Poor old Moontiki, now he needs revenge.\\n\\n\\n\\n\\n\\n\\n\\nTHe portals are there for Moontiki\\n\\n\\n\\nDuci locked poor Moontiki out. This one cries.\\n\\n\\n\\nLizard makes bones dance so this one moves to dead beach to rule. Moontiki takes his tent.\\n\\nBored Moontiki goes fishing\\n\\n\\n\\n\\n\\nMoontiki runs from crocodile!!!\\n\\n\\n\\nBone elf is a funny confused elf. It makes Moontiki laugh all night.\\n\\nLizard is Moontiki\\'s second favorite. \\n\\nThis one is sad Little Moontiki was missing. Old Moontiki will ask the mud crabs where it went.\\n\\n\\n\\n\\n\\n\\n\\nMoontiki is stuck in deep hole. Why they trap this one?\\n\\n\\n\\n\\n\\nThis one flew from great heights! But this one does not remember after it lept into high air. Moontiki thinks the trees were jealous of him and attacked Moontiki when he landed.\\n\\n\\n\\n\\n\\n\\n\\nThis one has found