stoled tbe pretty cage on the beach for things. Fun things. Old Moontiki will build a ship that flies over the storms. Big dragon eings for his ship. He will take Little Moontiki to find the Shaogorath. This one will have glory. This one spies on naked swimmers and dog. He didn\\'t throw rocks yet. It\\'s a bad puppy. Cat. This one likes cats better. The goats will serve Moontiki. He will rule them. Put dragon wings on them. This one needs a lad of rituals to light the sky. Make the little skooms cat better. Moontiki will bite the rocks. He goes to catch trees to make servants and grow him pineapples. He will let birds life in one tree only and they will make the new dolls sing.\\n\\n3\\n\\n3\\n',['title']='Tales of Moontiki Vol. 3',},['Z']=123341.275818,},[18]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=103147.193195,['Y']=33580,['Groups']=0,['Id']=2023,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=2.436480,['Pitch']=0,['SizeX']=180,['MetaData']={['message']='Tales of Moontiki Vol. 3',},['Z']=123367.291361,},[19]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=116927.991908,['Y']=72209,['Groups']=0,['Id']=2024,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=5.681047,['Pitch']=1.312488,['SizeX']=66.456456,['MetaData']={['message']='THIS ONE IS BLESSED! THIS ONE HAS HAD ALL DREAMS COME TRUE! THIS ONE IS THE TEA PARTY HOAST! THIS ONE UNDERSTANDS NOW! THIS ONE CRIES OF JOY! UNLCE SHEO LOVES THIS ONE AND SEES HIS MADNESS AND BRINGS THE TEA FOR THE PARTY! THIS ONE WILL.... this one needs party clothing.\\n\\n\\t\\t4\\n\\n\\t\\tJuly 11, 2021\\n\\n\\t\\t\\nThis one spies a truth or dare Death went first The Lord chose Dare He kissed the Sprout Sprout chose truth \\'Chickened Out\\' Death chose truth \\'Escape to a home\\' Silk chose Truth \\'No pets ever\\' Lord chose Truth \\'Rue\\'\\n\\n\\t\\tJuly 21, 2021\\n\\n\\t\\t\\nThis one needs a search party. He will find the best.\\n\\n\\t\\t2\\n\\n\\t\\t\\nThis one knows who his team will be after DAYS of dreaming! He will have the blind ones help. They have the noses to see the sounds. Ooooh, old Moontiki is so smart!\\n\\n\\t\\t2\\n\\n\\t\\t1. \\nWhites hairs and childrens... they are old like this one. DENTURES ASSEMBLE!\\n\\n\\t\\t2. \\nps. XOXOXO Granny Moontiki\\n\\n\\t\\t\\n\\n\\t\\t\\nThis one has a rescue party now! He is so good at being a hero! This one was stabbed! He was chased naked too. Poor old Moontiki. The cult jeaf did not save Moontiki si he had to find his in the scary place. He was healed! (edited)\\n\\n\\t\\t\\nThis one was stabbed! He was healed with a potion. He walks the beach for new guests. He hasa knife in his leg. This one found a dead fish. It sang to him.\\n\\n\\t\\t2\\n\\n\\t\\t\\n\\n\\t\\t\\nWritten by another\\'s hand Lived, laughed, danced and caused all kinds of trouble. A tea party host and a temperamental lunatic. Killed at the hands of another. Rest in peace Moontiki. May Sheogorath keep you entertained. \\n\\nTHIS ONE IS BLESSED! THIS ONE HAS HAD ALL DREAMS COME TRUE! THIS ONE IS THE TEA PARTY HOAST! THIS ONE UNDERSTANDS NOW! THIS ONE CRIES OF JOY! UNLCE SHEO LOVES THIS ONE AND SEES HIS MADNESS AND BRINGS THE TEA FOR THE PARTY! THIS ONE WILL.... this one needs party clothing.\\n\\n\\t\\t4\\n',['title']='Tales of Moontiki Vol. 4',},['Z']=128232.402364,},[20]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=116904.332566,['Y']=72260,['Groups']=0,['Id']=2025,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=5.693264,['Pitch']=0,['SizeX']=180,['MetaData']={['message']='Tales of Moontiki Vol. 4',},['Z']=128231.619862,},[21]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=111511.862431,['Y']=33664,['Groups']=0,['Id']=2027,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=5.469862,['Pitch']=0,['SizeX']=66.456456,['MetaData']={['message']='Written from the sixth month of the last year of the last era to the seventh month of the last year of the last era\\n\\n\\n\\n\\nEntry 1 I\\'ve been stuck on this Aedra forsaken hole for a few days now. Magic is working stupidly or not at all depending on where I am. T\\'aber, a good person and friend, found me some extra clothes. These ones are lighter than my furs and have some armour on them. \\n\\nIt would be nice if I could find a set of heavy armour that fits me, but the likelihood of that is small. I have yet to find a way of the island, but I\\'m sure I\\'ll find a way. I still don\\'t trust many on these beaches. Food hasn\\'t been an issue, though my sleeping arrangements could be improved. \\n\\n\\nI had a conversation with Hellebron about securing a room in her caste, but nothing concrete. I think my mood would improve immensely with a proper bed and bath. But alas, beggars cant be choosers By the eight what am I saying? Me? a beggar? Never. I\\'m just a noble down on his luck. \\n\\n\\nAt least there\\'s a lot of women to entertain myself with here, unfortunately I have yet to find a beauty to match my own. That I cannot hold out hope on, even back home none could match me. Oh well, at least I finally have a moment to myself to note down some of my thoughts so I don\\'t get too trapped in my own mind. .\\n\\n',['title']='Tales of a Noble Vol. 1',},['Z']=123799.532569,},[22]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=111456.482999,['Y']=33724,['Groups']=0,['Id']=2028,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=5.380850,['Pitch']=0,['SizeX']=180,['MetaData']={['message']='Tales of a Noble Vol. 1',},['Z']=123831.774719,},[23]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=105647.991155,['Y']=33680,['Groups']=0,['Id']=2029,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=0.787143,['Pitch']=0,['SizeX']=46.456456,['MetaData']={['message']='Entry 2 The writing is sloppy and lopsided. Not the usual font used for [Redacted], but it reflected his state. Drunk. \\n\\n\\nT\\'aber, T\\'aber, T\\'aber. What an excellent person. Calling me [Redacted], like everyone should. Everyone really should be calling me [Redacted]. It\\'s my title and name! [Redacted], is it really that hard? T\\'aber has a girlfriend, but alas, he is like a steel vault of secrets. I must learn something about them at some point. \\n\\n\\nQigwyn, nice fellow, a little meek. We had a nice boys night, just the three of us. It felt... normal. Good. Great even. \\n\\n\\nAnd the wine, sub par really but good enough. I can\\'t remember the last time I had a night to relax in the presence of others. When it whittled down to just us two we talked about my favorite subject, my beauty. Of course I was praised. I am a fine specimen. \\n\\n\\nBy the gods I got to sleep without my boots on. My feet feel refreshed finally. Now if I could get a half decent bath my life would be complete. .',['title']='Tales of a Noble Vol. 2',},['Z']=118298.786445,},[24]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=105670.208608,['Y']=33720,['Groups']=0,['Id']=2032,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=0.778417,['Pitch']=0,['SizeX']=180,['MetaData']={['message']='Tales of a Noble Vol. 2',},['Z']=118349.857918,},[25]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=109678.021484,['Y']=39125,['Groups']=0,['Id']=2033,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=5.960299,['Pitch']=4.625123,['SizeX']=46.456456,['MetaData']={['message']='Entry 3 The font is back to it\\'s fancy and regal script, though it appears to be a little hastily written I need to write some thoughts down. My father was right, he always is. Argonians are nothing but No. That\\'s not fair. Gods dammit. This is a mess. \\n\\n\\nBut that blow definitely would have left me severely wounded. Reaps is definitely a little bitch. Who strikes at someone who\\'s back is turned? A coward. I feel myself becoming my father. I am not my father. I am not my father. I am not my father. Qigwyn is nice. He protected me, a far different experience I\\'ve often had with Ugh, I am not my father, I am not my father, I am not my father. \\n\\n\\nMy god I\\'m writing lines again, what am I 16? No I\\'m a man. I am a proper man. A manly man. A man of his word. I AM these things. I am not a coward, or a liar, or \"sensitive\". I am going to try and write down some \"feelings\". I remember one of my companions said it was therapeutic to- A page has been torn and thrown into a fire to completely separate himself from it. [Redacted] felt that crossing out the words were not enough to erase what had been written. \\n\\n\\nI need a mirror, I haven\\'t gussied up in a while. The bed I have is adequate, but I still want a hot bath. .\\n\\nEntry 4 The font is very elegant, and it\\'s obvious that when (redacted) wrote he was taking his time. \\n\\n\\nI may be having a crisis. I think that\\'s what this feeling is. Everything I am, that I\\'ve worked towards, is gone. I was supposed to be the leader for Chorrol, but in their crisis, I wasn\\'t there. Now they\\'ve probably moved on without me. Even if I do manage to get off this island, then what? There is no place for me anymore. I can feel my head fill with so many questions and doubts. I remember I was told not to think to hard or I\\'d hurt my pretty little skull. ',['title']='Tales of a Noble Vol 3',},['Z']=125723.330058,},[26]={['EffectType']=4407,['SizeZ']=40,['Roll']=0,['X']=109704.065180,['Y']=39121,['Groups']=0,['Id']=2034,['SizeY']=40,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=5.976007,['Pitch']=0,['SizeX']=140,['MetaData']={['message']='Tales of a Noble Vol. 3\\n\\n',},['Z']=125698.253039,},[27]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=112212.493386,['Y']=71051,['Groups']=0,['Id']=2035,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=5.766568,['Pitch']=4.625123,['SizeX']=46.456456,['MetaData']={['message']='I think I\\'ve relied on that advice for far too long. To not think and to head in head first into trouble was my role as a heavy armored front liner. It was until I was abandoned. Why do I still cling to those values? \\n\\nIsn\\'t it meaningless? What even has meaning anymore? How is meaning derived from things? Before I thought it was my divine right to lead. It was the eight divines that gave me purpose. But once again I have been abandoned. \\n\\n\\nWhats the point? of anything? I don\\'t understand my role in the world anymore, I have no place to sit. And yet I feel myself pitifully struggling. I fear I cannot remove these pages from my journal until I\\'ve answered some questions, no matter how uncomfortable seeing these words makes me feel. Maybe a bath would ease my mind.\\n\\n\\nA nice hot bath by a hearth, surrounded by beautiful and doting women. \\n\\n\\nYes, that does sound nice. .\\n',['title']='Tales of a Noble Vol 4',},['Z']=124440.323446,},[28]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=112266.862759,['Y']=71051,['Groups']=0,['Id']=2036,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=5.595526,['Pitch']=0,['SizeX']=180,['MetaData']={['message']='Tales of a Noble Vol. 4',},['Z']=124409.908061,},[29]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=107841.727935,['Y']=39069,['Groups']=0,['Id']=2037,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=1.420698,['Pitch']=1.570971,['SizeX']=66.456456,['MetaData']={['message']='Entry 5 I think I�ve figured it out. Everything. I feel at peace. Well, I mean a bath would be nice, but being able to sit here, enjoy some wine and the view, and enjoy not having endless questions swarming my mind. Nothing matters here. \\n\\n\\n\\n\\n\\nWhile I�m here there is no divine purpose, no inherit power structure, nothing. All it is is a void that wants to be filled. I�m fine with filling that void, struggling to survive. I�m fine with all my achievements being useless No. They matter if they matter to me. If there is no higher power to please, the only one that needs pleasing is me. Wait, maybe not. Aug! More questions! I�m tired of questions, I don�t want to think, or feel, or think. \\n\\n\\n\\n\\n\\nI just want a solid answer! 1+1=2, This is the answer because it�s the answer, not because we want it to be, right? I don�t know what answer I want, I keep flipflopping. One day I�ll have my mind made about the nature of this world, and the next I think it�s something else. \\n\\n\\n\\n\\n\\nI got Kinmara to talk to me, for a while. I know she�s not the same Kinmara I knew, but, I find something comforting in seeing her. Oh by the eight I don�t know why it comforts me. Questions, questions, questions. Can they just stop for a moment? \\n\\n\\n\\n\\n\\nI got T�aber to answer some questions, I think. I was quite drunk so by the end of it, it seemed to blur with sleep. Ever since I was small, I�ve always wanted to know what makes people tick. What was it that they wanted, how could I satisfy that want, and be rewarded? I have found peace; I have answered enough questions to move on with my life. \\n\\n\\n\\n\\n\\nI just don�t need that kind of thinking in my life right now. I have found peace. .',['title']='Tales of a Noble V. 5',},['Z']=125728.893972,},[30]={['EffectType']=4407,['SizeZ']=22,['Roll']=0,['X']=107864.326893,['Y']=39101,['Groups']=0,['Id']=2040,['SizeY']=22,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=1.525418,['Pitch']=0,['SizeX']=120,['MetaData']={['message']='Tales of a Noble Vol. 5',},['Z']=125722.739335,},[31]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=120199.788024,['Y']=97933,['Groups']=0,['Id']=2041,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=3.494149,['Pitch']=4.890413,['SizeX']=46.456456,['MetaData']={['message']='Entry 6 [Redacted] writing is once again sloppy, a product of his intoxication. \\n\\n\\nMy head is at war with itself. I have conflicting opinions trying to take residence in my heart. I know the definitions of monster, and I know that a werewolf fits the description, but Kinmara? When she calls herself a monster it sounds like she�s using the definition that she�s monstrous. I don�t think she�s monstrous, but I feel like that�s in spite of her being a werewolf.\\n\\n\\n 1. I know from stories and experience that werewolves are monsters. They kill people.\\n\\n 2. I know from experience that Kinmara is a person, unbefitting of the name monster or monstrous. \\n\\n\\nWhat do I do with this contradiction? It genuinely physically hurts to think about. I know there�s some underlying problem I have yet to identify, I just don�t know what it is.\\n\\n\\n It�s absolutely infuriating to know there�s a problem but not know what it is. A simple solution would be to say not all werewolves are monstrous, but I feel like saying that is a disservice to people I�ve known who have been at my side and raised me.\\n\\n\\n It would be calling those that I have loved in the past wrong, and that their opinions would make them �monstrous�. It would mean that I�ve been wrong, what I�ve been doing is wrong. I can�t do that. I simply can�t. \\n\\n\\nWhy can�t I? Isn�t change good? Necessary? \\n\\n\\nBy the eight nothing makes sense here.',['title']='Tales of a Noble Vol. 6',},['Z']=128843.776421,},[32]={['EffectType']=4407,['SizeZ']=18,['Roll']=0,['X']=120193.919728,['Y']=97949,['Groups']=0,['Id']=2042,['SizeY']=18,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=3.544764,['Pitch']=0,['SizeX']=153,['MetaData']={['message']='Tales of a Noble Vol. 6',},['Z']=128873.054264,},[33]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['X']=107625.559699,['Y']=33684,['Groups']=0,['Id']=2043,['SizeY']=70,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=0.719076,['Pitch']=4.712564,['SizeX']=66.456456,['MetaData']={['message']='Entry 2 ((The handwriting looks of one who is very very old... attempting to maneuver their hand to write despite claws on her hand.)) \\n\\n\\n\\n\\n\\nIt is.. as expected. \\n\\n\\n\\n\\n\\nThe young one makes progress in her changes, yet her changes are ijust that ... in progress (and she is doing so well)... yet her changes are not yet complete. Upon frustration she speaks of old angry ways of coping. Mostly appearing to involve great physical harm to whatever it is that she sees as the source of her frustration. In this case, Seeks. \\n\\n\\n\\n\\n\\nWith the changes she is attempting to make, it is understandable that at times she may speak as if she is slipping back. Changes.. even desired ones.. are challenging. Times of stress.... make them even more so. \\n\\n\\n\\n\\n\\nThe other is more advanced in years than she and gives considerable pause against threats of physical violence to themselves. This is understandable. Yet use of many words does not clarify a situation - it simply confuses it further. It adds to frustration for the young one. \\n\\n\\n\\n\\n\\nHe speaks with a certain wisdom I admire yet he has not seen my series of cycles yet. If one speaks to speak, then many words are appropriate. If one speaks to be understood then the audience must be considered and the communication perhaps adjusted if possible without losing context. \\n\\n\\n\\n\\n\\nYet this is their issue - they have not sought my council. I simply wished to understsand  the situation between the two. \\n\\n\\n\\n\\n\\nI am clear now.',['title']='Tale of Makes-Many-Soups',},['Z']=123179.358127,},[34]={['EffectType']=4407,['SizeZ']=14,['Roll']=0,['X']=107610.123543,['Y']=33707,['Groups']=0,['Id']=2044,['SizeY']=14,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=0.757473,['Pitch']=6.108652,['SizeX']=101,['MetaData']={['message']='Tale of Makes-Many-Soups',},['Z']=123164.166719,},[35]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['X']=107499.527341,['Y']=33683,['Groups']=0,['Id']=2051,['SizeY']=50,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=4.017748,['Pitch']=0,['SizeX']=66.456456,['MetaData']={['message']='Once a book written on the island is forgotten, it will be added to the collection. \\n\\nAt times, words not written originally will be added. \\n\\nIf any added details of what the writer was doing was added outside of what was written,  they will also be in the books now to know where \\nthe author wrote, how they were feeling and more.\\n\\n2021 and before is last era\\n2022 and after if current era\\n\\n\\nThings lost to time... may surface here.',['title']='PLEASE READ:  About this Library',},['Z']=121965.760839,},[36]={['EffectType']=4407,['SizeZ']=22,['Roll']=0,['X']=107505.922241,['Y']=33723,['Groups']=0,['Id']=2052,['SizeY']=22,['Color']=158999,['Contrast']=1,['Alpha']=1,['Yaw']=4.038692,['Pitch']=0,['SizeX']=120,['MetaData']={['message']='Please Read:  About This Library ',},['Z']=121968.929401,},[37]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['X']=105688.438822,['Y']=33711,['Groups']=0,['Id']=2053,['SizeY']=70,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=2.813471,['Pitch']=1.026254,['SizeX']=66.456456,['MetaData']={['message']='As the character moves around the foyer\\nand throughout the library, they will hear the sound of very litght movement... far overhead.  \\nIt would follow them around, as if tracking, sometimes they would hear one.. other times... up to four separate ..  creatures.\\n\\nAlso they would feel anywhere they went the eyes of the gargoyles...  never moving but... perceptive chacracters would sense them also tracking them throughout the library. \\n\\n Those with keen noses.. would smell both the giant spiders and the gargoyles as their scent permeated everthing along with the scent of old, musty manuscripts, tomes and scrolls.\\n\\nEvery onece in a while a soft cracking noise might be heard if you move too far out of the gargoyle\\'s range of vision.\\n',['title']='WELCOME!  Library OOC Information',},['Z']=119673.699810,},[38]={['EffectType']=4407,['SizeZ']=42,['Roll']=0,['X']=105697.019596,['Y']=33748,['Groups']=0,['Id']=2054,['SizeY']=42,['Color']=139992,['Contrast']=1,['Alpha']=1,['Yaw']=5.808456,['Pitch']=0,['SizeX']=140,['MetaData']={['message']='       WELCOME!  \\nLibrary OOC Information',},['Z']=119690.413744,},[39]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['X']=110614.143593,['Y']=33684,['Groups']=0,['Id']=2062,['SizeY']=70,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=1.307252,['Pitch']=4.712564,['SizeX']=66.456456,['MetaData']={['message']='Vine Willow Inn Mercenaries- Written from the tenth month of the last year of the old era to the third month of the first year of the new era\\n\\n\\n\\n\\n\\nEntry 1\\n\\n\\n\\nAfter careful research I have discovered that when the cursed box the captain found and opened despite the warnings, not only did it mark him, curse the inn headquarters and use all who were sleeping as sacrifices to cast the curse on the in, but it also removed the entire building and grounds to what seems to be a pocket realm.\\n\\nUpon further investigation I have discovered that there is a portal that appears and leads to a large island of sorts. However, this portal only appears when the cursed captain will not be able to use it.\\n\\nWith this information I have taken the appropriate steps to improve the lives of the greatest number.\\n\\n                    \\nZae Tajah\\n\\n\\n\\n.\\n\\n[6:48 PM]\\n\\nEntry 2\\n\\n\\n\\nOMGs Zae turned the boss into a chicken and won\\'t turn him back!\\n\\n\\n\\nI don\\'t want to go to the island... there might be people there.... that might talk at me.... \\n\\n                     Kae\\'Elle\\n\\n\\n\\n.\\n\\n[6:49 PM]\\n\\nEntry 3\\n\\n\\n\\ncorn stains and chicken scratches mark the page\\n\\n\\n\\n.\\n\\n[6:49 PM]\\n\\nEntry 4\\n\\n\\n\\nJude, do not feed the chicken on the observervation journal unless you would like me to remove your opposable thumbs. That is simply gross.\\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\n[6:50 PM]\\n\\nEntry 5\\n\\n\\n\\nWhy did the boss read a journal? He heard it had some corny jokes inside\\n\\n\\n                -JD\\n\\n\\n\\n.\\n\\n[6:50 PM]\\n\\nEntry 6\\n\\n\\n\\nShut up Jude. \\n\\n                \\nZae Tajah\\n\\n[6:51 PM]\\n\\n.\\n\\n\\n\\nEntry 7\\n\\n\\n\\nCrud.... Zae isn\\'t fixing the boss.\\n\\n\\n\\n\\n\\n\\n',['title']='Tales of Vine Willow Mercs Vol. 1',},['Z']=124812.607567,},[40]={['EffectType']=4407,['SizeZ']=13,['Roll']=0,['X']=110619.601357,['Y']=33703,['Groups']=0,['Id']=2063,['SizeY']=13,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=1.289798,['Pitch']=0,['SizeX']=83,['MetaData']={['message']='Tales of the Vine Willow Mercs  Vol. 1',},['Z']=124810.861946,},[41]={['EffectType']=8501,['SizeZ']=30,['Roll']=0,['X']=102291.957025,['Y']=33620,['Groups']=0,['Id']=2064,['SizeY']=30,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=3.108431,['Pitch']=5.759587,['SizeX']=26.456456,['MetaData']={['message']='I mean, I would leave him a chicken longer because it\\'s way quieter now but, I am dying of allergies while Jude and Bob keep letting him back inside and I cannot keep living in the bath house. It\\'s killing my paper.\\n\\n\\n\\nUuughhh I don\\'t want to talk to people...\\n\\n\\n\\nMaybe if I let Cody out he can distract Jude and the Bob.\\n\\n                   Kae\\'Elle \\n\\n\\n\\n.\\n\\n\\n\\nEntry 8\\n\\n\\n\\nNote to all: Let Cody out and I\\'ll turn you all into maggots.\\n\\nSincerely,\\n\\n                  \\nZae Tajah\\n\\n\\n\\n.\\n\\n[6:52 PM]\\n\\nEntry 9\\n\\n\\n\\nThat island is cool. Chill librarian, wild Argonian with a lich cat, no cannibals so far. Starting to think Zae was lying about that.\\n\\nDidn\\'t find a book for boss man but lizard said she can unchicken things. Wants some relic. Zae probs has one. Said she might stay at the inn for a little once she is ready. Maybe she has to back some bags or something and plan a trip?\\n\\n                  JD\\n\\n\\n\\n.\\n\\n[6:53 PM]\\n\\nEntry 10\\n\\n\\n\\nI said \"Watch your back so you don\\'t end up a meal\" and after all the undead, vampires, werewolves and wild animals our travels have thrown at us and your automatic thought is cannibals????\\n\\n                    \\nZae Tajah\\n\\nPs. If you touch any of my things you can join General Rune.\\n\\n\\n\\n.\\n\\n[6:53 PM]\\n\\nEntry 11\\n\\n\\n\\nBloody nobles. Does she even know how grating her noble nose stuck in the air is?\\n\\nI\\'ll make a wine just for her.\\n\\n\\n\\nLooks like gold can still be earned here. Does it have any value will be the question.\\n\\nAn Argonian was told of the dreams and wants to see her mummy again. Maybe I will stay on the island until those dreams fade.\\n\\n\\n\\nThe irony of the night: the Altmer was friendly and the Khajiit down to earth. At least there are a few that might not need a potion kick in the butt.\\n\\n                   \\nZae Tajah\\n\\n\\n',['title']='Tales of the Vine Willow Mercs',},['Z']=122769.706759,},[42]={['EffectType']=4407,['SizeZ']=6,['Roll']=0,['X']=102280.157719,['Y']=33670,['Groups']=0,['Id']=2065,['SizeY']=6,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=3.183481,['Pitch']=0,['SizeX']=100,['MetaData']={['message']='Tales of the Vine Willow Mercs Vol. 2',},['Z']=122741.789529,},[43]={['EffectType']=8501,['SizeZ']=30,['Roll']=0,['X']=105658.800623,['Y']=33627,['Groups']=0,['Id']=2066,['SizeY']=30,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=0.626573,['Pitch']=4.450590,['SizeX']=26.456456,['MetaData']={['message']='Entry 12\\n\\n\\n\\nPlease don\\'t fight with the islanders... ._.\\n\\n                   Kae\\'Elle\\n\\n\\n\\n.\\n\\n\\n\\nEntry 13\\n\\n\\n\\nUgh... I am going to need to go look for the book myself. Pretty sure Zae has one in her room, but I don\\'t want to die looking there.\\n\\nUgh... people...\\n\\nAlso Jude. Bro came back, got camping gear and went back to the island and not seen him since. Who does that?\\n\\n                 Kae\\'Elle\\n\\n\\n\\n.\\n\\n[6:55 PM]\\n\\nEntry 14\\n\\n\\n\\nYeah, k, found Jude. He is trying to dig out some tunnel an Argonian said collapsed. \\n\\nWill look for a book now. Man, I better not find anyone else. Why couldn\\'t this have been a deserted island?\\n\\n             Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 15\\n\\n\\n\\nJude needs to get back. All the stuff I need for fortification is in the basement with Cody.\\n\\nAlso need to take a helmet next time I go to the island.\\n\\nHope the Argonian Reaps didn\\'t kill the green one with no name. Tried to get her to leave too but she didn\\'t want to go. \\n\\nI couldn\\'t talk Zae out of letting the Argonian stay, so need to get boss back because at least there is a chance he will say no.\\n\\n             Kae\\'Elle\\n\\n\\n\\n.\\n\\n[6:57 PM]\\n\\nEntry 16\\n\\n\\n\\nI met a hot girl. Tiny, dark, mysterious, cool. She was very impressed by my awesome rock moving skills.\\n\\nThere was also an Argonian that reminded me of my mom, and a giant lady into bone styles. \\n\\nNo cannibals yet. These people seem pretty fun. I like the new neighbors.\\n\\nTaking a break for some sleep and food from the work.\\n\\n                 JD\\n\\n\\n\\n.\\n\\nEntry 17\\n\\n\\n\\nAre you working or free again???? You better not be working for free again.\\n\\n                  \\nZae Tajah\\n\\n\\n\\n.\\n\\n[6:59 PM]\\n\\nEntry 18\\n\\n\\n\\nI lost a bet to Jude and now I gotta help move rocks... I don\\'t wanna!\\n\\n              Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 19\\n\\n\\n\\nJude tried to kill me and I died.\\n\\n                  Kae\\'Elle\\n\\n',['title']='Tales of the Vine Willow Mercs Vol. 3',},['Z']=119058.251744,},[44]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=105635.569992,['Y']=33661,['Groups']=0,['Id']=2067,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=0.427606,['Pitch']=0,['SizeX']=220,['MetaData']={['message']='Tales of the Vine Willow Mercs Vol. 3',},['Z']=119001.444345,},[45]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['X']=115310.877215,['Y']=50004,['Groups']=0,['Id']=2068,['SizeY']=70,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=0.928515,['Pitch']=4.712564,['SizeX']=66.456456,['MetaData']={['message']='Entry 20\\n\\n\\n\\nDead people are quite, so unfortunately you are not dead.\\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 21\\n\\n\\n\\nIt all hurts.....\\n\\n                Kae\\'Elle \\n\\n\\n\\n.\\n\\nEntry 22\\n\\n\\n\\nStupid tends to hurt.\\n\\n             \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:00 PM]\\n\\nEntry 23\\n\\n\\n\\nfood stains mark the page\\n\\n\\n\\nSomeone needs to dream us some sandwiches. Sandwiches go with fun work. We should cave more tunnels in after this.\\n\\nGoing back to work. Maybe I will see the pretty girl again. \\n\\n               JD\\n\\n\\n\\n.\\n\\nEntry 24\\n\\n\\n\\nDo NOT touch this book with grubby food hands again Jude\\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 25\\n\\n\\n\\nTHAT\\'S IT! I\\'M OUT! I\\'m staying on the island until this mess is delt with. Bloody, flaming, stupid, son of a blasted Oblivion hagrat!\\n\\n                \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:01 PM]\\n\\nEntry 26\\n\\n\\n\\nSo... chickens dream... and um... now the Inn has mounds of corn and grubs in all the central areas... this is gross...\\n\\nCORN JUICE DRIPPED ON ME! EEEEEEWWW! \\n\\nNope. I can\\'t. Even people are better than this. Island time.\\n\\n                  Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:03 PM]\\n\\nEntry 27\\n\\n\\n\\nEyeballs rolling spinning twisting on the floor\\n\\n\\nCatch them quick before they roll out the door\\n\\n\\nStomp them into piles of mush and keep them in the underbrush\\n\\n\\nDon\\'t you cry, don\\'t you scream, stay here my lovely, hush\\n\\n\\n                 \\nS\\n\\n\\n\\n.\\n\\nEntry 28\\n\\n\\n\\nDo NOT open this book for NIGHTMARES.\\n\\n                \\nZae Tajah\\n\\n\\n\\n.\\n\\n\\n\\nEntry 29\\n\\n\\n\\nBut Bob wanted to write....\\n\\n                     JD\\n\\n\\n\\n.\\n\\n[7:04 PM]\\n\\nEntry 30\\n\\n\\n\\n\\n\\n\\n',['title']='Tales of the Vine Willow Mercs',},['Z']=131598.539452,},[46]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['X']=115327.549506,['Y']=50032,['Groups']=0,['Id']=2069,['SizeY']=20,['Color']=99,['Contrast']=1,['Alpha']=1,['Yaw']=0.788889,['Pitch']=0,['SizeX']=200,['MetaData']={['message']='Tales of the Vine Willow Mercs Vol. 4',},['Z']=131578.830516,},[47]={['EffectType']=8501,['SizeZ']=30,['Roll']=0,['Alpha']=1,['Contrast']=1,['Groups']=0,['Id']=2071,['SizeY']=30,['Color']=102439,['Y']=39137,['X']=108878.672310,['Yaw']=5.363397,['Pitch']=4.625123,['SizeX']=26.456456,['MetaData']={['message']='Entry 30\\n\\n\\n\\na page that would later be inserted into the journal\\n\\n\\n\\nIn an attempt to once again have the opportunity to sleep in, I took the chicken to the beach and set it free. Unfortunately, the portal at the Inn flipped and now as soon as you step in you are stepping back out. The moment between playing a children\\'s chicken song.\\n\\nThis stupid in it seems will not allow any back to the Inn unless we bring Ezrial back to it. And the second this inconvenience was discovered was the second that stupid chicken ran!\\n\\nNow I have to find the stupid bug infested goat licking bird man if I don\\'t want to live on a stinking beach!\\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\n\\n\\nEntry 31\\n\\n\\n\\na page that would later be interested into the journal\\n\\n\\n\\nOh thank the devines! I heard boss on North Beach! \\n\\nI nearly died trying to catch him and he got away, but he is alive!\\n\\n                Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:06 PM]\\n\\nEntry 32\\n\\n\\n\\nMeanwhile at the Inn.....\\n\\n\\n\\nSea water filled the lower floor and a few rats swam for their lives, looking for higher ground, furniture drifted about, bumping into each other and a great undead spider worked overhead, making its giant web in the open area between the second and third floors.\\n\\n\\n\\nBut, unfazed, Jude lept from the drifting dining table to the floating front desk, arms out for balance... \"If everybody had an ocean\\n across Tamriel\\n then everybody\\'d be surfin\\'\\n like I am ah-a. You\\'d seem \\'em wearing their baggies\\n farmer sandals too\\n A bushy bushy blonde hairdo\\n Surfin\\' with me!\"\\n\\n\\n\\n.\\n\\nEntry 33\\n\\n\\n\\na page would later be interested into the journal\\n\\n\\n\\nI am about ready to burn down this island and see what the stupid portal does with a dead chicken.\\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:07 PM]\\n\\nEntry 34\\n\\n\\n\\na page that would be inserted later\\n\\n\\n\\n',['title']='Tales of the Vine Willow Mercs Vol. 5',},['Z']=124974.823120,},[48]={['EffectType']=4407,['SizeZ']=18,['Roll']=0,['Alpha']=1,['Contrast']=1,['Groups']=0,['Id']=2072,['SizeY']=18,['Color']=99,['Y']=39145,['X']=108907.810933,['Yaw']=5.312782,['Pitch']=0,['SizeX']=117,['MetaData']={['message']='Tales of the Vine Willow Mercs Vol. 5',},['Z']=124955.653771,},[49]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['Alpha']=1,['Contrast']=1,['Groups']=0,['Id']=2073,['SizeY']=70,['Color']=102439,['Y']=97929,['X']=121705.039796,['Yaw']=5.892232,['Pitch']=4.537856,['SizeX']=66.456456,['MetaData']={['message']='I found boss. He pecked my eye and got away.\\n\\n                  Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 35\\n\\n\\n\\na page that would be inserted later\\n\\n\\n\\nSo... apparently boss attacked some lady last night and then bailed to some new fog beach that no one knows much of anything about.... ._.\\n\\n                Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:09 PM]\\n\\nEntry 36\\n\\n\\n\\na page that would be inserted later\\n\\n\\n\\nNow the way back is totally missing. Lovely. Just lovely.\\n\\nLikely due to the stupid chicken nord being through another portal.\\n\\nPossibly due to him meeting an untimely end, thiugh I find this possibility less likely.\\n\\n                   \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 37\\n\\n\\n\\na page that would be inserted later\\n\\n\\n\\nI got a lead on boss but, it didn\\'t go anywhere. HOW THE HECK DOES A FREAKING ROOSTER THAT SCREAMS EVERY 20 MINUTES HIDE SO WELL?????\\n\\nI wish M\\'att or Dad was here to help me find boss....\\n\\n                  Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 38\\n\\n\\n\\nI am going to turn that fool man into a guppy. At least THOSE are quiet.\\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:11 PM]\\n\\nEntry 39\\n\\n\\n\\nBack to the Inn at long last. Hiding outside however at the moment because Jude turned the place into his personal beach with sharks and everything while we were away. Zae Tajah and Boss are inside yelling at him right now. At least it is a beautiful day to reenforce everything again all the crazy things on the island. Managed to get all kinds of metals and silvers while I was on the shores so I have a lot to work with.\\n\\nThe window cages are all ready but will have to wait for it to be safe to go back inside and nab Jude for extra hands. Working on a really stupid project right now. Creating iron and silver vines to mix in with the real willow vines to make it so nothing can go over the walls and still have the entrance area look nice.\\n\\n             Kae\\'Elle',['title']='Tales of the Vine Willow Mercs Vol. 6',},['Z']=128296.268383,},[50]={['EffectType']=4407,['SizeZ']=22,['Roll']=0,['Alpha']=1,['Contrast']=1,['Groups']=0,['Id']=2074,['SizeY']=22,['Color']=99,['Y']=97981,['X']=121690.652589,['Yaw']=5.907940,['Pitch']=0,['SizeX']=100,['MetaData']={['message']='Tales of the Vine Willow Mercs Vol. 6\\n',},['Z']=128358.567298,},[51]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['Alpha']=1,['Y']=49909,['Groups']=0,['Id']=2075,['Pitch']=4.625123,['Color']=102439,['Contrast']=1,['X']=121787.605003,['Yaw']=4.925319,['SizeY']=70,['SizeX']=46.456456,['MetaData']={['message']='Entry 40\\n\\n\\n\\nBlasted sorcerer. Turned me into a bloody chicken for weeks. My luck has tanked since I opened the cursed box. Dodgedthe spell just for it to rebound off the undead spider that chewed its way out of the basement at that EXACT MOMENT. Bloody freaking terrible luck.\\n\\n\"Bring excitement, make dreams and nightmares real\" it said. \"Will tear what is apart\" it said.\\n\\nYeah, there is all kinds of excitement around and I can only get in on it when I am a STUPID BIRD.\\n\\nBeach place looked cool. Was about to get some adventure in and look around but the stupid gryphon dropped a rock on my head. My mercs apparently though take me back to this cursed in was a good idea. I\\'ll tame that bird as my own. Bring on the claws you Oversized feather duster!\\n\\nWonder if this island has any cute ladies or rock flinging monsters around to make it less boring.\\n\\nWonder if there is a better deal around than the stupid box. Need some excitement. \"Open the gates of Oblivion and let the things out\" it said. More like we got dragged into Oblivion\\'s zen garden where all the fun happens just on the other side of the fence.\\n\\nCouldn\\'t a few of my more interesting soldiers have been dragged here too instead of the magical crab and the nerd? Earthbound knows how to drink. Frander or Wiltting or Eats Ox would have been more fun. Blasted luck. Bet they were the ones it cost for the spell to cast. Bet dead is more than this. Starting to think the blasted portal to the island won\\'t show up for me until the island seems boring too.\\n\\n               Captain Ezrial Rune\\n\\n\\n\\n.\\n\\n[7:13 PM]\\n\\nEntry 41\\n\\n\\n\\nMan, I met a werewolf that didn\\'t try to kill me. It was awesome! She is cool too. And tall! Also cooks good. Said she is really old though. Probably as old as Zae and getting arthritis or something. Bummer.\\n\\n \\n',['title']='Tales of the Vine Willow Mercs. Vol. 7',},['Z']=132333.267159,},[52]={['EffectType']=4407,['SizeZ']=20,['Roll']=0,['Alpha']=1,['Y']=49909,['Groups']=0,['Id']=2076,['Pitch']=0,['Color']=99,['Contrast']=1,['X']=121839.859469,['Yaw']=4.846779,['SizeY']=20,['SizeX']=180,['MetaData']={['message']='Tales of the Vine Willow Mercs. Vol. 7',},['Z']=132326.909390,},[53]={['EffectType']=8501,['SizeZ']=70,['Roll']=0,['Alpha']=1,['Y']=50981,['Groups']=0,['Id']=2077,['Pitch']=4.799655,['Color']=102439,['Contrast']=1,['X']=124730.714596,['Yaw']=4.494223,['SizeY']=70,['SizeX']=66.456456,['MetaData']={['message']='Entry 42\\n\\n\\n\\na few pages are crumpled and the cover a bit crooked, almost like the book was used to beat something or someone over the head\\n\\n\\n\\n.\\n\\n\\n\\nEntry 43\\n\\n\\n\\nI got 3 nu buddies now. Sar, Seeks n T\\'aber. They are pretty cool. Trying to get Sar to join our band. She has cool eys but, no powers with them. She needs some. Like, purple lightning or a purple seeing eye ghoul. Oh, healer too. Is spectacular.\\n\\n                     JD\\n\\n\\n\\n.\\n\\n[7:15 PM]\\n\\nEntry 43\\n\\n\\n\\nJude, you are NOT allowed to recruit. Do you remember the blasted nanny incident? I will seal you in a tomb again.\\n\\n                   \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 44\\n\\n\\n\\nFor the record, that nanny was creepy.\\n\\n                Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 45\\n\\n\\n\\nAnd Jude never came back with the things I asked for. Looks like I will have to pry the Imperial out of her room and send her.\\n\\n                  \\nZae Tajah\\n\\n\\n\\nEntry 46\\n\\n\\n\\nI found a cool creepy doll on the beach.\\n\\n                JD\\n\\n\\n\\n.\\n\\n[7:16 PM]\\n\\nEntry 47\\n\\n\\n\\nThat lizard is a crack up! He knows all the best jokes. And found a buddy to teach to be epic at dodgeball so I can have a better challenge soon.\\n\\nWas kinda fun losing the portal again too. Took up hours to find it! Zae wasn\\'t happy, but the rest of us had fun finding it. \\n\\n               JD\\n\\n\\n\\n.\\n\\nEntry 48\\n\\n\\n\\nDid the beach shrink?\\n\\n               Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:18 PM]\\n\\nEntry 49\\n\\n\\n\\nWhoa, whoa, whoa. Most the people on the island keep journals??? I need to read these things! Who is with me? Stealth music activated. \\n\\n                   JD\\n\\n\\n\\n.\\n\\nEntry 50\\n\\n\\n\\nNo.\\n\\n              \\nZae Tajah \\n\\n\\n\\nWould give good insight. I would like to read them.\\n\\n             Kae\\'Elle \\n\\n\\n\\n.\\n\\n',['title']='Tales of the Vine Willow Mercs.  Vol. 8',},['Z']=133988.771559,},[54]={['EffectType']=4407,['SizeZ']=22,['Roll']=0,['Alpha']=1,['Y']=51005,['Groups']=0,['Id']=2078,['Pitch']=0,['Color']=99,['Contrast']=1,['X']=124757.205411,['Yaw']=4.396484,['SizeY']=22,['SizeX']=160,['MetaData']={['message']='Tales of the Vine Willow Mercs.  Vol. 8',},['Z']=134001.153547,},[55]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['Alpha']=1,['Y']=50036,['Groups']=0,['Id']=2079,['Pitch']=4.625123,['Color']=102439,['Contrast']=1,['X']=114078.325699,['Yaw']=1.905900,['SizeY']=50,['SizeX']=46.456456,['MetaData']={['message']='Entry 51\\n\\n\\n\\nAs your Captain, you do not have permission to violate other\\'s privacy unless you bring the documentation here so I can read this information too. Oblivion, reading. Bloody never ending boredom is driving me insane.\\n\\n               Captain Rune\\n\\n\\n\\n.\\n\\nEntry 52\\n\\n\\n\\nYou are all idiots. \\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:19 PM]\\n\\nEntry 52\\n\\n\\n\\nI need to get out of the Inn for awhile. Take a walk. It\\'s been a rough day.\\n\\n               Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 53\\n\\n\\n\\nBob laid an egg. Am I going to be an uncle?\\n\\n                JD\\n\\n\\n\\n.\\n\\nEntry 54\\n\\n\\n\\nI think Bob is broken.\\n\\n               Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:21 PM]\\n\\nEntry 55\\n\\n\\n\\nReaps is great! We had the best time last night talking about her fam and Bob!\\n\\nWe were really bonding.\\n\\n                 JD\\n\\n\\n\\n.\\n\\nEntry 56\\n\\n\\n\\nWell.... that happened. Bob just escaped to the island... Good luck catching him Jude. Would help but, gotta dig others out from the snow in here.\\n\\n                Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 57\\n\\n\\n\\nBob is on fire!\\n\\n               JD\\n\\n\\n\\n.\\n\\nEntry 58\\n\\n\\n\\nOh... Bob is back and... is lighting the Inn on fire... ZAE!!!!\\n\\n                 Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:23 PM]\\n\\nEntry 59\\n\\n\\n\\nWell. Bob went home. Time to explore.\\n\\n              JD\\n\\n\\n\\n.\\n\\n\\n\\nEntry 60\\n\\n\\n\\nApparently this time of year is going to be VERY annoying at the Inn. I will temporarily move to the island as this is ridiculous!\\n\\n               \\nZae Tajah\\n\\n\\n',['title']='Tales of the Vine Willow Mercs. Vol. 9',},['Z']=133135.278723,},[56]={['EffectType']=4407,['SizeZ']=22,['Roll']=0,['Alpha']=1,['Y']=50048,['Groups']=0,['Id']=2080,['Pitch']=0,['Color']=99,['Contrast']=1,['X']=114046.629508,['Yaw']=1.904154,['SizeY']=22,['SizeX']=120,['MetaData']={['message']='Tales of the Vine Willow Mercs. Vol. 9\\n',},['Z']=133128.145461,},[57]={['EffectType']=8501,['SizeZ']=50,['Roll']=0,['Alpha']=1,['Y']=50033,['Groups']=0,['Id']=2081,['Pitch']=4.537856,['Color']=102439,['Contrast']=1,['X']=111279.983861,['Yaw']=2.741912,['SizeY']=50,['SizeX']=46.456456,['MetaData']={['message']='Entry 61\\n\\n\\n\\nI wonder if any of the islanders trust each other. Do they even like each other? \\n\\n              Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:24 PM]\\n\\nEntry 62\\n\\n\\n\\nude slides across the frozen Inn floor. \"THIS IS AWESOME!\" \\n\\n\\n\\nKae\\'Elle tries to get up but gets dogpiled by a bunch of kids and slides into a wall with them.\\n\\n\\n\\nEzrial \"WHY ARE THERE CHILDREN EVERYWHERE???\" watches kids swinging from eveything andd sliding around the frozen floors and climbing on all the furniture. \\n\\n\\n\\nZae Walks over to look down from the second floor to see dozens of people and children and ice and snow. \"Oh heck no.\" Quickly walks back to the room she had been working in and locks the door.\\n\\n\\n\\nJude has this ice thing down and is now trying tricks \"It\\'s the most wonderful time of the year!\\n\"\\n\\n\\n\\nKae\\'Elle grabs the journal before crashing to the cold floor again.\\n\\n\\n\\nS.O.S. The dream families have arrived in force!\\n\\n\\n\\n.\\n\\n[7:25 PM]\\n\\nEntry 63\\n\\n\\n\\nZae watches as Jude sand way, working to dislodge the crystals on the cliff. Kae\\'Elle had built some kind of makeshift scaffolding between the stone ruins and the outcropping holdibg the crystals. Picks up one of the stones to examine it. These could be very useful. Gathers up the crystals as Jude freed them from the earth.\\n\\n\\n\\n.\\n\\nEntry 64\\n\\n\\n\\nWait, wait, wait! There is a party today???\\n\\n                    JD\\n\\n\\n\\n.\\n\\nEntry 65\\n\\n\\n\\nWoah! I found the pie I lost last year! It was in my New Life festival pocket!\\n\\nOh... that was bad.. Don\\'t eat year old pie. \\n\\n                JD\\n\\n\\n\\n.\\n\\n\\n',['title']='Tales of the Vine Willow Mercs. Vol. 10',},['Z']=137393.428104,},[58]={['EffectType']=4407,['SizeZ']=40,['Roll']=0,['Alpha']=1,['Y']=50046,['Groups']=0,['Id']=2082,['Pitch']=0,['Color']=99,['Contrast']=1,['X']=111279.804140,['Yaw']=3.059562,['SizeY']=40,['SizeX']=180,['MetaData']={['message']='Tales of the Vine Willow Mercs. Vol. 10\\n',},['Z']=137462.585690,},[59]={['Z']=131872.468928,['Id']=2083,['Roll']=0,['X']=112238.316750,['Y']=50245,['Contrast']=1,['Groups']=0,['SizeY']=50,['Color']=102439,['SizeZ']=50,['Alpha']=1,['Yaw']=5.747369,['Pitch']=4.625123,['SizeX']=46.456456,['MetaData']={['message']='Entry 67\\n\\n\\n\\nDown to the last thing needed for the spell. However, acquiring enough is going to be tricky. \\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:28 PM]\\n\\nEntry 68\\n\\n\\n\\nOkay, so, this snow covered forest was cool to start but then someone had to go and dream of cannibal badgers and now no one can leave the rooms without getting their ankles chewed off. The flaming luck is this????\\n\\n                Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 69\\n\\n\\n\\nIt appears idiocy is alive and well outside of my room today.\\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 70\\n\\n\\n\\nBob ate a badger and it was great! I can\\'t stop laughing!\\n\\n          JD\\n\\n\\n\\n.\\n\\nEntry 71\\n\\n\\n\\nThat\\'s what that sound was? Oblivion, thought Zae summoned a deadlands demon pit fight.\\n\\n               Captain Ezrial Rune\\n\\n\\n\\n.\\n\\nEntry 72\\n\\n\\n\\nI think Bob is making a nest with cannibal badger bodies now. \\n\\n             JD\\n\\n',['title']='Tales of the Vine WIllow Merc.  Vol. 11',},['EffectType']=8501,},[60]={['Z']=131849.315070,['Id']=2084,['Roll']=0,['X']=112252.060351,['Y']=50265,['Contrast']=1,['Groups']=0,['SizeY']=22,['Color']=99,['SizeZ']=22,['Alpha']=1,['Yaw']=5.668829,['Pitch']=0,['SizeX']=120,['MetaData']={['message']='Tales of the Vine WIllow Merc.  Vol. 11',},['EffectType']=4407,},[61]={['Z']=136238.477841,['Id']=2085,['Roll']=0,['X']=114312.692910,['Y']=49060,['Contrast']=1,['Groups']=0,['SizeY']=82,['Color']=102439,['SizeZ']=82,['Alpha']=1,['Yaw']=3.789110,['Pitch']=1.047198,['SizeX']=66.456456,['MetaData']={['message']='Entry 73\\n\\n\\n\\nOh well. Locked in my room anyways. Time to make that list I guess.\\n\\n\\n\\nEzrial- Idk any more\\n\\nZae-- Trust mostly\\n\\nJude- Trust, but remember rot brain\\n\\nAlari- Idk\\n\\nLauendral- Nope, might be cult creep buddy\\n\\nReaps- Nope, will stab you\\n\\nSyrenta- Idk, did I meet her?\\n\\nRose- Never trust a baby\\n\\nSeeks- Trust, just weird\\n\\nT\\'aber- Nope, doesn\\'t add up\\n\\nSar- Idk, helpful but sketchy\\n\\nRoxana- Nope, sketchy\\n\\nKinmara- Nope, might be cult creep buddy\\n\\nMirrim- Idk, would prob accept jobs for good pay though\\n\\nZafrik- NOPE, freaking phyco\\n\\nJo\\'sha- Kinda, need more info\\n\\nGilen- Idk\\n\\nDura- Idk\\n\\n\\n\\nIdk like anyong else so... or maybe just forgot others.\\n\\n\\n\\n               Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:30 PM]\\n\\nEntry 74\\n\\n\\n\\nscribbles all over the first list\\n\\n\\n\\nEzrial- --Idk any more-- A bro\\n\\nZae- --Trust mostly-- A bro \\n\\nJude- Trust, but remember rot brain. Awww, thank you!\\n\\nAlari- --Idk-- A bro\\n\\nLauendral- --Nope, might be cult creep buddy-- A Bro\\n\\nReaps- --Nope, will stab you-- A bro\\n\\nSyrenta- Idk, did I meet her? I don\\'t know this one.\\n\\nRose- --Never trust a baby-- Always trust a baby!\\n\\nSeeks- --Trust, just weird-- A bro\\n\\nT\\'aber- --Nope, doesn\\'t add up-- A bro\\n\\nSar- --Idk, helpful but sketchy-- A bro\\n\\nRoxana- Nope, sketchy. I don\\'t know her either!\\n\\nKinmara- --Nope, might be cult creep buddy-- A bro and rib master \\n\\nMirrim- --Idk, would prob accept jobs for good pay though-- A bro to be\\n\\nZafrik- NOPE, freaking phyco. I don\\'t know like, anyone.\\n\\nJo\\'sha- Kinda, need more info. Same.\\n\\nGilen- --Idk-- A bro and a half!\\n\\nDura- -\\nIdk\\n- Epic bro\\n\\n               JD\\n\\n\\n',['title']='Tales of the Vine Willow Mercs. Vol. 12',},['EffectType']=8501,},[62]={['Z']=136240.335681,['Id']=2086,['Roll']=0,['X']=114320.718806,['Y']=49115,['Contrast']=1,['Groups']=0,['SizeY']=40,['Color']=99,['SizeZ']=40,['Alpha']=1,['Yaw']=4.984660,['Pitch']=0,['SizeX']=160,['MetaData']={['message']='Tales of the Vine Willow Mercs. Vol. 12',},['EffectType']=4407,},[63]={['Z']=138697.130741,['Id']=2087,['Roll']=0,['X']=120007.811641,['Y']=49493,['Contrast']=1,['Groups']=0,['SizeY']=50,['Color']=102439,['SizeZ']=50,['Alpha']=1,['Yaw']=0.829031,['Pitch']=4.450590,['SizeX']=46.456456,['MetaData']={['message']='Entry 75\\n\\n\\n\\nThe Inn is quite today. This is odd.\\n\\n\\n\\nHmm. I would like to study what the Inn is doing more accurately, however, 2 test subjects are not enough for and concrete findings. Perhaps the next time those on the island seem calm, I will ask for volunteers to stay at the Inn to better see what is happening without knowing the history of said islanders.\\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:31 PM]\\n\\nEntry 76\\n\\n\\n\\nSo apparently Kae\\'Elle tried to small talk and that went over about as well as expected. I needed that laugh. \\n\\n               \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 77\\n\\n\\n\\nUgh I need to \\'earn trust\\'. Why can\\'t this place be normal and use gold as its currency like every other place in the blasted world?\\n\\n                   Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 78\\n\\n\\n\\nThis because those islanders didn\\'t answer half your questions the other night? Just slip them all truth portions. Easier. Faster. More accurate.\\n\\n                  \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 79\\n\\n\\n\\nDon\\'t tempt me. \\n\\n                Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:33 PM]\\n\\nEntry 80\\n\\n\\n\\nWell. I think we can be glad that it was Jude that stepped out of the portal to a crocodile falling on his head and not anyone else. Have him patched up, but will need to bring in someone with more skills to get him back on his feet. \\n\\n                \\nZae Tajah\\n\\n',['title']='Tales of the Vine Willow Merc. Vol. 13',},['EffectType']=8501,},[64]={['Z']=138676.055421,['Id']=2088,['Roll']=0,['X']=119970.324000,['Y']=49490,['Contrast']=1,['Groups']=0,['SizeY']=22,['Color']=99,['SizeZ']=22,['Alpha']=1,['Yaw']=1.048943,['Pitch']=0,['SizeX']=140,['MetaData']={['message']='Tales of the Vine Willow Merc. Vol. 13',},['EffectType']=4407,},[65]={['Z']=138898.540654,['Id']=2089,['Roll']=0,['X']=112982.522083,['Y']=49553,['Contrast']=1,['Groups']=0,['SizeY']=50,['Color']=102439,['SizeZ']=50,['Alpha']=1,['Yaw']=2.323033,['Pitch']=1.483530,['SizeX']=46.456456,['MetaData']={['message']='Entry 81\\n\\n\\n\\nMade it out and back fine with a healer for Jude. Healer nearly killed herself healing him. Really though. There should be better strategies for healing. \\n\\nHealers on the island are insane. Cat is half sane I suppose. They think the island it alive. Had a chatty (Redguard?) with cognitive issues follow me halfway back to the Inn. I was going to ditch her, but then we were attacked by a squid??\\n\\nAnd now MY bloody flaming shoulder is broken. I am NOT going back out there to find another insane healer. Curse that beach to oblivion to rot.\\n\\nAND the doors sealed. Now she is stuck here. I am loading her up on drinks to prevent sleep.\\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 82\\n\\n\\n\\nI don�t have cognitive issues, you have cognitive issues! -Roxana\\n\\n\\n\\n.\\n\\n[7:34 PM]\\n\\nEntry 83\\n\\n\\n\\nBook has clearly been thrown across the room and now is dented\\n\\n\\n\\nOkay. New thing learned. Anyone trapped here can read and write in this book.\\n\\n\\n\\nWhere is Ezrial?\\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 84\\n\\n\\n\\nThe Inn is still sealed up tight, Ezrial is nowhere to be seen and I couldn\\'t keep Roxana up any longer. I hope she does not dream. I believe Jude did however as we now have a skeleton cult sacrificing fish in the bath house.\\n\\n                 \\nZae Tajah\\n\\n\\n\\n.\\n\\n[7:36 PM]\\n\\nEntry 85\\n\\n\\n\\nAwww there are baby ducks everywhere! Fluffy cuteness!\\n\\n\\n            -Kae\\'Elle\\n\\n\\n\\n.\\n\\nEntry 86\\n\\n\\n\\nThank the GODS! The portal is open again! Ezrial is back too.\\n\\nI think there might be a tie between him and hiw the portal works.\\n\\nI am going to find a healer now. I will deal with finding the girl after.\\n\\n              \\nZae Tajah',['title']='Tales of the Vine Willow Mercs. Vol. 14',},['EffectType']=8501,},[66]={['Z']=138880.725120,['Id']=2090,['Roll']=0,['X']=112981.339296,['Y']=49593,['Contrast']=1,['Groups']=0,['SizeY']=22,['Color']=99,['SizeZ']=22,['Alpha']=1,['Yaw']=2.377138,['Pitch']=0,['SizeX']=120,['MetaData']={['message']='Tales of the Vine Willow Mercs. Vol. 14',},['EffectType']=4407,},[67]={['Z']=123057.633280,['Id']=2091,['Roll']=0,['X']=108586.133243,['Y']=33668,['Contrast']=1,['Groups']=0,['SizeY']=50,['Color']=102439,['SizeZ']=50,['Alpha']=1,['Yaw']=5.607743,['Pitch']=5.672320,['SizeX']=46.456456,['MetaData']={['message']='Entry 87\\n\\n\\n\\nFinally! At least the Argonian was chatty! \\n\\n                     Kae\\'Elle\\n\\n\\n\\n.\\n\\n[7:38 PM]\\n\\nEntry 88\\n\\n\\n\\nOops\\n\\n             JD\\n\\n\\n\\n.\\n\\nEntry 89\\n\\n\\n\\nOh gods, why is Jude saying \\'oops\\'....\\n\\n              \\nZae Tajah\\n\\n\\n\\n.\\n\\nEntry 90\\n\\n\\n\\nHuh, maybe the lizard isn\\'t that bad.\\n\\n                    - Captain Ezrial Rune\\n\\n\\n\\n.\\n\\n[7:39 PM]\\n\\nEntry 91\\n\\n\\n\\nBonfire tonight? Count me in! I love fires! \\n\\n                -JD\\n\\n\\n\\n.\\n\\nEntry 92\\n\\n\\n\\nI ate too many marshmallows. My stomach hurts...\\n\\n              JD \\n\\n\\n\\n.\\n\\nEntry 93\\n\\nGods Jude is a baby.\\n\\n                  -Zae Tajah\\n\\n\\n\\n.\\n\\n[7:40 PM]\\n\\nEntry 94\\n\\n\\n\\nA few more mirrors. This is going to take some time. At least a goblin is involved in looking now.\\n\\n                 -Zae Tajah\\n\\n\\n\\n.\\n\\nEntry 95\\n\\n\\n\\nI met new friends the other day! They were really nice. The floating goblin was AWESOME! Hellzah? And Harleen has stories! I think. They talked about stories at least. OH and the nord, Anneke was fun! I saw Dar too! We explored the icy place! We need to see the place past the stairs sometime!\\n\\n               JD\\n\\n\\n\\n.\\n\\nEntry 96\\n\\n\\n\\nTalked to islanders today. It was weird.\\n\\n                Kae\\'Elle\\n\\n',['title']='Tales of the Vine Willow Mercs. Vol. 15',},['EffectType']=8501,},[68]={['Z']=123079.810667,['Id']=2092,['Roll']=0,['X']=108576.977200,['Y']=33708,['Contrast']=1,['Groups']=0,['SizeY']=22,['Color']=99,['SizeZ']=22,['Alpha']=1,['Yaw']=5.520476,['Pitch']=0,['SizeX']=140,['MetaData']={['message']='Tales of the Vine Willow Mercs. Vol. 15',},['EffectType']=4407,},},}"
