R["fx__na__@mantisign__80"]="{['TS']=1649082553,['Effects']={[1]={['SizeX']=2,['X']=118216.877161,['EffectType']=5018,['Alpha']=1,['SizeZ']=3,['Roll']=0,['Groups']=0,['Color']=696968,['Pitch']=6.195919,['MetaData']={['message']='Ravenclaw Tower is open, but yet a riddle is still spoken:\\n\\nI am not of land, but born of sea\\nMy cousin moos incessantly\\nI am not a race, but nails have thee\\nI am, of course, a ...?',['name']='Eagle door knocker',},['Yaw']=5.529203,['Y']=29889,['Z']=101706.234015,['Id']=1097,['Contrast']=1,['SizeY']=3,},[2]={['SizeX']=66.456456,['X']=118954.881398,['EffectType']=8502,['Alpha']=1,['SizeZ']=130,['Roll']=0,['Groups']=0,['Color']=102439,['Pitch']=0,['MetaData']={['title']='Noticeboard',['message']='A warm and witty welcome to all students!\\n\\nRavenclaw Tower is open for tours for a limited time. \\n\\nSome points of interest for those touring our common room include a library inspired by Uric the Oddball and an astronomy loft dedicated to the late Perpetua Fancourt (inventor of the lunascope). It goes without saying that there\\'s a statue of Rowena Ravenclaw, the founder of our house and the most brilliant witch of her age.\\n\\nRowena Ravenclaw designed this tower (as well as much of the rest of Hogwarts Castle). Ravenclaw\\'s common room boasts the most windows for a single room in Hogwarts. There\\'s twenty, in case you were wondering.\\n\\nP.S. The answer is manatee.\\n\\nSincerest regards,\\nRobert Hilliard, Prefect',},['Yaw']=2.912955,['Y']=29790,['Z']=102103.945929,['Id']=1105,['Contrast']=1,['SizeY']=130,},[3]={['SizeX']=22,['X']=120165.492086,['EffectType']=5079,['Alpha']=1,['SizeZ']=59,['Roll']=0,['Groups']=0,['Color']=999998,['Pitch']=0,['MetaData']={['name']=' ',},['Yaw']=0.895354,['Y']=29970,['Z']=101457.158885,['Id']=1106,['Contrast']=1,['SizeY']=59,},[4]={['SizeX']=24,['X']=121747.444395,['EffectType']=5018,['Alpha']=1,['SizeZ']=54,['Roll']=0,['Groups']=0,['Color']=696969,['Pitch']=0,['MetaData']={['message']=' ',['na