,['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=27347,['Contrast']=1,['X']=25619,['SizeY']=300,['EffectType']=5018,['Yaw']=0,['Y']=10081,['SizeZ']=300,},[37]={['Id']=1252,['Roll']=0,['MetaData']={['name']='Whispers',['message']='Dread father only has favor to one being... The master of this place has walked with him..',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=25905,['Contrast']=1,['X']=24437,['SizeY']=300,['EffectType']=5018,['Yaw']=1.570796,['Y']=10158,['SizeZ']=300,},[38]={['Id']=1253,['Roll']=0,['MetaData']={['name']='Whispers',['message']='He not only walked with  Anu and Padomay but helps the Father...',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=24839,['Contrast']=1,['X']=22468,['SizeY']=300,['EffectType']=5018,['Yaw']=0,['Y']=10712,['SizeZ']=300,},[39]={['Id']=1254,['Roll']=0,['MetaData']={['name']='Whispers',['message']='You do not belong in the masters home...',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=29139,['Contrast']=1,['X']=22094,['SizeY']=300,['EffectType']=5018,['Yaw']=1.570796,['Y']=10149,['SizeZ']=300,},[40]={['Id']=1255,['Roll']=0,['MetaData']={['name']='Whispers',['message']='Leave the masters workshop...',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=37909,['Contrast']=1,['X']=19770,['SizeY']=300,['EffectType']=5018,['Yaw']=0,['Y']=10480,['SizeZ']=300,},[41]={['Id']=1256,['Roll']=0,['MetaData']={['name']='Self Thoughts',['message']='I get the feeling I should not be here...',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=39212,['Contrast']=1,['X']=12978,['SizeY']=300,['EffectType']=5018,['Yaw']=4.712389,['Y']=10644,['SizeZ']=300,},[42]={['Id']=1257,['Roll']=0,['MetaData']={['name']='Self Thoughts',['message']='I really.. should not be here.. this place stinks of decay and death...',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=38648,['Contrast']=1,['X']=15392,['SizeY']=300,['EffectType']=5018,['Yaw']=4.712389,['Y']=10612,['SizeZ']=300,},[43]={['Id']=1258,['Roll']=0,['MetaData']={['name']='Whispers',['message']='A new soul to join us... Join us...',},['Color']=696969,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=36408,['Contrast']=1,['X']=17720,['SizeY']=300,['EffectType']=5018,['Yaw']=0,['Y']=10040,['SizeZ']=300,},[44]={['Id']=1259,['Roll']=0,['MetaData']={['name']='Whisper',['message']='Begone with you or you will be marked....  Soul or not... our family or not...\\nleave my childs home....\\n-Cave shakes',},['Color']=696968,['SizeX']=130,['Groups']=0,['Pitch']=0,['Alpha']=0,['Z']=31498,['Contrast']=1,['X']=19464,['SizeY']=300,['EffectType']=5018,['Yaw']=0,['Y']=9609,['SizeZ']=300,},[45]={['Id']=1260,['Roll']=0,['MetaData']={['title']='For Her',['message']=' Life time over Life time... I dont care how long it takes I will bring her back with a real resurrection... the people of this \"Gold Coast\" tend to call me the collector and some who end up here in my workshop.. more parts for my tools to use when the time is needed.\\n_______________________________________\\n  \\n    I have the Crystal heart and the key... now\\nSome may think a true Resurrection is not able to be done. Yes im no divine or Daedra but I have Lived for a long time to know that object like these, that seem that they would not go together, will work together. \\n  My goal is simple enough to bring my love back to me. Hold her again and protect her.\\n  \\n   I told the dread father and the others I did not want help, I must bring her back! NO strings NOTHING. She will be fully resurrectd without any strings or anyone to hold anything over her or I....\\n\\n  I thank the few that help me see, I thank my wife for helping my heart and I thank the few beings that have made me to allow me to keep on having more bodies to switch with and work on... Immortal yes, can I still die.. yes.. seems like Daedra can \"reform\" back in Oblivion, the same is said for me tho.. its just a empty void when im there... I will not die again while I have found my wifes body... any harm to her or where she rests in that pocket area then.. I will make Mannimarco seem nothing but a fly or a small gust of wind to waht I will do to the souls of the few that harm her. \\n____________________________________\\n I was told by a few not to get in the affairs of the princes\\nNot to make my real nature known and to keep her away and hidden.\\n With the promise that she will be kept safe.\\nHow dare you Anu... how dare you Padomay.. I thank you for life but I hate you for taking my heart away...\\n\\nOne day my love...',},['Color']=333333,['SizeX']=26.456456,['Groups']=0,['Pitch']=5.232497,['Alpha']=1,['Z']=25991.043752,['Contrast']=0.290000,['X']=22558.735535,['SizeY']=30,['EffectType']=8503,['Yaw']=3.145083,['Y']=10722,['SizeZ']=30,},[46]={['Id']=1272,['Roll']=0,['MetaData']={['houseid']=68,['owner']='@MalacaeGaming',},['Color']=635899,['SizeX']=260,['Groups']=0,['Pitch']=0,['Alpha']=1,['Z']=30913,['Contrast']=1,['X']=27314,['SizeY']=440,['EffectType']=4500,['Yaw']=4.712389,['Y']=10152,['SizeZ']=440,},[47]={['Id']=1296,['Y']=10122,['MetaData']={['lore book']=81,['lore collection']=16,['lore category']=3,},['Roll']=0,['Color']=828282,['Groups']=0,['Pitch']=5.239478,['Alpha']=1,['Z']=33456.247000,['Contrast']=0.410000,['X']=27191.709299,['SizeY']=30,['EffectType']=8002,['Yaw']=4.105014,['SizeX']=26.456456,['SizeZ']=30,},[48]={['Id']=1297,['Y']=10079,['MetaData']={['title']='No Strings.',['message']=' It would seem that not only the Crsytal Heart can help me with this but also the Lady of Decay has seem to see favor in me. My Loves body does not rot but stays as if she is sleeping... it... hurts to see My Love like so.. its like all this was a trick, something that never was real... like she never died for me.. stupid woman... I could have taken the sword and if worse comes to past I would have had to recollect myself.. tho you would have aged and time passed. I would still love you the same... Anu and Padomay you play a mean fate for me, No I was not the first nor last made by you and I am happy I was not. In a way I was made by parts of you but just what the hell am I to Live so long and be able to reform as the Daedra do.. but unlike the Daedra I just seem to go into.. a void..\\nI will have the keys for your resurrection my love. No necromantic strings but a real Resurrection.',},['Roll']=0,['Color']=102439,['Groups']=0,['Pitch']=4.729842,['Alpha']=1,['Z']=33353.370800,['Contrast']=1,['X']=26169.905944,['SizeY']=30,['EffectType']=8502,['Yaw']=4.963716,['SizeX']=26.456456,['SizeZ']=30,},},}"
