99,['Yaw']=2.792527,['Contrast']=1,},[8]={['EffectType']=522,['X']=48468,['Alpha']=1,['Z']=44936,['SizeX']=512,['Id']=1620,['Pitch']=0,['SizeZ']=512,['Groups']=0,['Y']=12965,['Roll']=0,['SizeY']=512,['Color']=995217,['Yaw']=5.061455,['Contrast']=1,},[9]={['EffectType']=8501,['X']=49827,['Alpha']=0.840000,['Id']=1621,['Z']=44875,['SizeX']=26.456456,['Pitch']=5.148721,['MetaData']={['message']='I have had the most wonderful evening. I never wanted it to end. Alas, this day has indeed come to an end. It is past midnight. \\n\\nTythis walked me to the gate of my garden. Before saying goodbye, we stood on the bridge and talked. He has the darkest eyes, full of mystery. He asked if I wanted to go out with him again. I said yes. Yes, very much so.\\n\\nGorgonzola startled us when she suddenly walked up to stand next to me. Hah, I think both of us totally forgot about them. Too bad they had to stay outside. Dumb rules. Anyway, Tythis commented on that she was looking a lot bigger than earlier. We also suddenly noticed that Harold was not with us. I think Tythis got a bit disturbed about that and our parting was rather abrupt. He was going to look for Harold.\\n\\nI had a spring in my step walking the path to my house. I also caught myself giggling! Gorgonzola sluggishly followed. Tired maybe. Hmm, Tythis had a point there. She was looking rather large.\\n',['title']='Nuzhimeh\\'s Notebook',},['SizeZ']=30,['Groups']=0,['Y']=12719,['Roll']=0,['SizeY']=30,['Color']=692799,['Yaw']=1.570796,['Contrast']=1.920000,},[10]={['EffectType']=4405,['X']=49830,['Alpha']=1,['Id']=1622,['Z']=44866,['SizeX']=120,['Pitch']=0,['MetaData']={['message']='       - The End -',},['SizeZ']=42,['Groups']=0,['Y']=12783,['Roll']=0,['SizeY']=42,['Color']=399923,['Yaw']=0.959931,['Contrast']=1,},[11]={['EffectType']=4580,['X']=48825,['Alpha']=1,['Z']=45433,['SizeX']=100,['Id']=1623,['Pitch']=0,['SizeZ']=140,['Groups']=0,['Y']=13073,['Roll']=0,['SizeY']=140,['Color']=999999,['Yaw']=3.141593,['Contrast']=