,['Y']=3198,['Groups']=0,['Yaw']=0.024435,['Roll']=0,['Color']=667499,['SizeZ']=124.687500,['SizeY']=124.687500,['Contrast']=1,},[10]={['EffectType']=8503,['X']=73271,['Alpha']=1,['Id']=2332,['Z']=35901,['SizeX']=26.456456,['Pitch']=1.483530,['MetaData']={['message']='Six months locked up with Hroltar in this miget house in the middle of the desert. Unbelievable. And for what? A stupid contest.  I\\'m not even attracted to Queen Ayrenn!\\n\\nFather was furious. Still is, I\\'m sure.\\n\\nTo make it worse, I\\'ve been denied access to servants. I wasn\\'t even allowed to bring my personal attendant. It seems I should be able to use Hroltar as my servant but I know better than to try. It\\'ll just throw him into a laughing fit. Not giving him that. I\\'m not talking to him at all and that\\'s how it\\'s gona be.\\n\\nOnly thing to eat here is camel. Yep, Awesome. Camel soup, camel steak, baked camel, camel casserole, camel eggs....yeah.. this is not good..i feel sick just writing about it.\\n\\n',['title']='Prince Irnskar\\'s Journal - Keep Out, Private!',},['Y']=3088,['Groups']=0,['Yaw']=5.242969,['Roll']=0,['Color']=993015,['SizeZ']=30,['SizeY']=30,['Contrast']=1,},[11]={['EffectType']=8501,['X']=73443,['Alpha']=1,['Id']=2334,['Z']=36323,['SizeX']=26.456456,['Pitch']=1.483530,['MetaData']={['message']='Not sure if it\\'s possible to die of boredom but I guess I\\'ll find out. This wasn\\'t exactly how I had envisioned my life for the next few months, stuck in a house with Irnskar. Thinking about it though...it\\'s hilarious!! He\\'s put me on ignore. Like, he doesn\\'t respond to anything at all. \\n\\nI mean, so I made this bet with Irnskar that, between the two of us, Queen Ayrenn would pick me to go on a date. He thought nah, Ayrenn would choose him and was gona prove it. Anyway, his dad got on to us and ended the whole thing before I could win. That guy has a temper and exiled us to this isolated place in the middle of the desert as punishment for, as he said, embarrassing him and \"potentially undermining the peace between the peoples of Tamriel\" - bwahahaa\\n\\nI do regret not getting the opportunity to give Queen Ayrenn the presents I had prepared for my courting finale. I had paid good gold to an artist in town for a couple of fine portraits, one of her and one of myself. I believe she would have been deeply impressed by these gifts.\\n\\nYeah she would have picked me, no doubt. Irmskar never had a chance!\\n\\nAt least I know how to make food for myself. Irnskar can\\'t cook. He\\'s trying. He won\\'t eat anyting I make or even share a meal at the same table. Harsh. Clearly he\\'s blaming me for this whole thing. Why though? He was totally into it! \\nHe\\'s over by the aquarium now, whisteling as if he doesn\\'t have a care in the world. \\nMeh... I\\'m going for some mead. \\n',['title']='HROLTAR',},['Y']=3078,['Groups']=0,['Yaw']=4.443608,['Roll']=0,['Color']=877213,['SizeZ']=50,['SizeY']=50,['Contrast']=1.380000,},[12]={['EffectType']=397,['X']=71666,['Alpha']=1,['Z']=36350,['SizeX']=432,['Id']=2335,['Pitch']=6.276204,['Y']=8350,['Groups']=0,['Yaw']=1.609194,['Roll']=0,['Color']=999999,['SizeZ']=492,['SizeY']=492,['Contrast']=1,},[13]={['EffectType']=432,['X']=71891,['Alpha']=1,['Z']=36359,['SizeX']=340,['Id']=2337,['Pitch']=0,['Y']=8062,['Groups']=0,['Yaw']=1.570796,['Roll']=0,['Color']=999957,['SizeZ']=360,['SizeY']=360,['Contrast']=1,},[14]={['EffectType']=463,['X']=72092,['Alpha']=1,['Z']=35778,['SizeX']=100,['Id']=2345,['Pitch']=0,['Y']=8126,['Groups']=0,['Yaw']=0,['Roll']=0,['Color']=292900,['SizeZ']=100,['SizeY']=100,['Contrast']=1,},[15]={['EffectType']=8501,['X']=71081,['Alpha']=1,['Id']=2354,['Z']=37671,['SizeX']=26.456456,['Pitch']=4.705408,['MetaData']={['message']='    -Surrounded by Sand-\\nSand in ma hair\\nsand in ma ears\\nsand in ma eyes\\nsand in ma crack\\n\\nbetter a tent by the bog\\na cave by the sea\\na bedroll under open sky\\nthan locked inside this fancy oasis\\n\\n\\n\\n      -  The Skald-King -\\nYou\\'re a red faced loud mouthed brute\\nand I hope you will spend the rest of your life\\nbeing repeatedly teabagged by camels\\n\\n\\n\\n\\n\\n\\n',['title']='Hroltar\\'s Poems',},['Y']=8700,['Groups']=0,['Yaw']=5.948082,['Roll']=0,['Color']=998538,['SizeZ']=30,['SizeY']=30,['Contrast']=1,},},['Version']='16.1.0',['HouseId']=34,['TS']=1612739417,},},['Key']='fx__@maarlith',['TS']=1612739417,}"
