ype']=8501,['Y']=12827,['X']=58196,['MetaData']={['message']='This house was a lot of fun to build but it took a lot to get it all together -- outside help was definitely brought in. I owe thanks to these following people who all knowingly or unknowingly helped me create this.\\n\\n@Acorncupcake and her husband for not even hesitating to give me floor pieces I needed -- but also for @acorncupcake for always being a supportive friend that I try to impress.\\n\\n@stabittydoom for the youtube EHT guides. This was my first house where I had EHT from start to finish. My other houses had everything added afterwards! I think the beginner guides worked.\\n\\n@Delphinnia who first encouraged me to get EHT and answered my questions as they came up. Also, I think the first housing videos I ever saw on youtube were from Delphi. So strange to call her a guildmate now -- in multiple guilds! Such a small-world feeling, but it\\'s great! lol.\\n\\nAnd thanks to the many Royal Fam guildies who I used as guinea pigs.\\n\\nAnd thanks to Dominant Dominion for not kicking me or giving me shit because I was busy decorating instead of defending our Queen in cyrodiil lol.\\n\\nOh and just a shout out to the old classical greek statue \"the old market woman,\" which focuses on the beauty of the disturbing & trades exaggerated beauty for realism. I originally felt weird wanting to make a giant statue of a nude night mother but I think it came out well & I am proud of it.',['title']='Special Thanks!',},['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=0,['Z']=36376,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=4.708898,['Id']=1508,},[255]={['EffectType']=655,['Y']=4035,['X']=55446,['Color']=494949,['Contrast']=1,['Alpha']=1,['Pitch']=0,['Z']=31215,['SizeX']=1840,['SizeZ']=1840,['Groups']=0,['SizeY']=1840,['Roll']=0,['Yaw']=3.141593,['Id']=1509,},[256]={['EffectType']=8502,['Y']=2708,['X']=54777,['MetaData']={['message']='/say Sanguine',['title']='What is th