oups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1636,},[52]={['EffectType']=5018,['Y']=9231,['X']=81510,['MetaData']={['message']='Oh that one looks special! Open it!',['name']='Historian Phedre',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=0,['Z']=65200,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1637,},[53]={['EffectType']=5018,['Y']=9231,['X']=81415,['MetaData']={['message']='A varla stone! Come put it in this lantern by me!',['name']='Historian Phedre',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=0,['Z']=65151,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1638,},[54]={['EffectType']=5018,['Y']=9698,['X']=82579,['MetaData']={['message']='Look around for me. I\\'ll let you know when you find something good!',['name']='Historian Phedre',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=3.141593,['Z']=62669,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=6.021386,['Id']=1639,},[55]={['EffectType']=5018,['Y']=9612,['X']=78488,['MetaData']={['message']='A black stone was once given as a gift to a sailor out at sea. It reeked of daedric power. ',['name']='Mysterious Voice',},['Color']=3599,['Contrast']=3.680000,['Alpha']=1,['Yaw']=1.570796,['Z']=74080,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1640,},[56]={['EffectType']=5018,['Y']=9292,['X']=78058,['MetaData']={['message']='Battles were fought over the stone. Everyone wanted its power.',['name']='Mysterious Voice',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=1.570796,['Z']=75511,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1641,},[57]={['EffectType']=5018,['Y']=9292,['X']=77581,['MetaData']={['message']='The victor emerged, a Sea Elf queen who promised to use the stone only for good. She, of course, would be the judge of what was good.',['name']='Mysterious Voice',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=1.570796,['Z']=76231,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1642,},[58]={['EffectType']=5018,['Y']=9492,['X']=76889,['MetaData']={['message']='The night of the queen\\'s victory, her daughter stole the stone before the queen could ever use it. The daughter knew her mother too well. She knew the chaos this stone would bring.',['name']='Mysterious Voice',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=1.570796,['Z']=76569,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1643,},[59]={['EffectType']=5018,['Y']=9616,['X']=76575,['MetaData']={['message']='And so I\\'ve been hidden here this whole time. Forgotten. ',['name']='Chromatic Pearl',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=4.712389,['Z']=75335,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1644,},[60]={['EffectType']=8503,['Y']=11484,['X']=78822,['MetaData']={['message']='Sailors will sing sweet songs of their friendly interactions with the mythical mermaids. Ballads about the aid they bring: the sweet fresh fruits and luxury foods. Ballads about their curious nature. Ballads about the mermaids\\' own songs in a language too beautiful to understand. These mythical creatures are generally kept in high regards.\\n\\nThe truth will spoil much of that. All of those ballads are bardic lies. The songs instead be songs of caution. These sirens of the seas ought to be depicted as the true zealous fanatics they are. Mermaids willingly serve daedra in exchange for beauty and power. Mermaids are the witches of the sea. Perhaps they are not as quite as vile as the Sload since mermaids do seem to avoid necromancy, but a mermaid\\'s power rivals a Sload\\'s. They are formidable and are not to be considered friendly.\\n\\nAbove all else, beware of any chromatic pearls they offer, it\\'s a charm to corrupt you. If you are offered one, consider this an attack--because it is an attack. Should you accept the pearl, you will halucinate grand colors which will hyponotize and confuse you. Just say no and draw your weapon.\\n\\nFinal warning: do not accept their food. Do not teach them about you. Do not listen to their songs. Do not accept any pearls. Immediately find a way to flee and prepare to defend yourself.',['title']='The Daedric Mermaids',},['Color']=265399,['Contrast']=1.600000,['Alpha']=1,['Yaw']=6.195919,['Z']=74535,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=1.134464,['Id']=1645,},[61]={['EffectType']=963,['Y']=10018,['X']=78246,['Color']=6874,['Contrast']=4,['Alpha']=0,['Yaw']=1.570796,['Z']=74230,['SizeX']=400,['SizeZ']=260,['Groups']=0,['SizeY']=260,['Roll']=0,['Pitch']=0,['Id']=1646,},[62]={['EffectType']=963,['Y']=10018,['X']=78244,['Color']=6874,['Contrast']=4,['Alpha']=0,['Yaw']=1.570796,['Z']=74910,['SizeX']=500,['SizeZ']=500,['Groups']=0,['SizeY']=500,['Roll']=0,['Pitch']=0,['Id']=1647,},[63]={['EffectType']=963,['Y']=10018,['X']=77803,['Color']=147999,['Contrast']=1.620000,['Alpha']=0,['Yaw']=1.570796,['Z']=75394,['SizeX']=500,['SizeZ']=500,['Groups']=0,['SizeY']=500,['Roll']=0,['Pitch']=0,['Id']=1648,},[64]={['EffectType']=963,['Y']=10056,['X']=77477,['Color']=379993,['Contrast']=0.780000,['Alpha']=0,['Yaw']=0,['Z']=75969,['SizeX']=500,['SizeZ']=500,['Groups']=0,['SizeY']=500,['Roll']=0,['Pitch']=0,['Id']=1649,},[65]={['EffectType']=963,['Y']=10056,['X']=76831,['Color']=379993,['Contrast']=0.780000,['Alpha']=0,['Yaw']=0,['Z']=76245,['SizeX']=420,['SizeZ']=500,['Groups']=0,['SizeY']=500,['Roll']=0,['Pitch']=0,['Id']=1650,},[66]={['EffectType']=5018,['Y']=9532,['X']=78293,['MetaData']={['message']='The stone would be a great tool.',['name']='Mysterious Voice',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=1.570796,['Z']=75054,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1651,},[67]={['EffectType']=5018,['Y']=9171,['X']=81351,['MetaData'